INSERT INTO `it_keyword_meaning` VALUES (1, 'a machine that performs a function according to a predetermined set of coded instructions, especially one capable of a range of programmed responses to different circumstances.', 'เครื่องมือหรืออุปกรณ์คำนวณชนิดหนึ่งซึ่งมีหน่วยความจำจำกัด (ใช้สถานะจำกัดในการจดจำ) และรับข้อมูลโดยการอ่านแถบบันทึกรับเข้า โดยที่อุปกรณ์ชนิดนี้จะให้คำตอบว่าสายอักขระที่อยู่ในแถบบันทึกรับเข้านั้นยอมรับได้หรือไม่ได้ ', 'dictionary.com', 1);
INSERT INTO `it_keyword_meaning` VALUES (2, 'R is an open-source statistical programming language and framework that\'s used for a wide range of scientific applications, including machine learning.', ' ภาษา R คือภาษาของคอมพิวเตอร์ตัวหนึ่ง ที่ใช้สำหรับวิเคราะห์ข้อมูลทางด้านสถิติและตัวเลข ซึ่งนิยมใช้กันมากในหมู่นักสถิติในด้านการพัฒนาซอฟต์แวร์สถิติ ', 'dictionary.com', 2);
INSERT INTO `it_keyword_meaning` VALUES (3, 'a method of calculation, especially one of several highly systematic methods of treating problems by a special system of algebraic notations', 'คณิตศาสตร์ชั้นสูงแขนงหนึ่ง ว่าด้วยเรื่องค่าของจำนวนที่เปลี่ยนแปลงอย่างต่อเนื่องตลอดเวลา', 'dictionary.com', 3);
INSERT INTO `it_keyword_meaning` VALUES (4, 'a system of accepted rules about behaviour, based on what is considered right and wrong', 'ธรรมที่เป็นข้อประพฤติปฏิบัติ, ศีลธรรม, กฎศีลธรรม.', 'dictionary.com', 4);
INSERT INTO `it_keyword_meaning` VALUES (5, 'someone\'s idea, invention, creation, etc., that can be protected by law from being copied by someone else', 'ความคิดของใครบางคน การประดิษฐ์การสร้างสรรค์ฯลฯที่กฎหมายสามารถปกป้อง มิให้ ผู้อื่นคัดลอกได้', 'dictionary.com', 5);
INSERT INTO `it_keyword_meaning` VALUES (6, 'the development, implementation, and maintenance of computer hardware and software systems to organize and communicate information electronically', 'การพัฒนา ดำเนินการ และบำรุงรักษาฮาร์ดแวร์คอมพิวเตอร์และระบบซอฟต์แวร์เพื่อจัดระเบียบและสื่อสารข้อมูลทางอิเล็กทรอนิกส์', 'dictionary.com', 6);
INSERT INTO `it_keyword_meaning` VALUES (7, 'a study of an individual unit, as a person, family, or social group, usually emphasizing developmental issues and relationships with the environment, especially in order to compare a larger group to the individual unit.', 'ศึกษาหน่วย บุคคล ครอบครัว หรือกลุ่มสังคม มักจะเน้นปัญหาการพัฒนาและความสัมพันธ์กับสิ่งแวดล้อม โดยเฉพาะอย่างยิ่งเพื่อเปรียบเทียบกลุ่มใหญ่กับแต่ละหน่วย', 'dictionary.com', 7);
INSERT INTO `it_keyword_meaning` VALUES (8, 'the development, implementation, and maintenance of computer hardware and software systems to organize and communicate information electronically', 'การพัฒนา ดำเนินการ และบำรุงรักษาฮาร์ดแวร์คอมพิวเตอร์และระบบซอฟต์แวร์เพื่อจัดระเบียบและสื่อสารข้อมูลทางอิเล็กทรอนิกส์', 'dictionary.com', 8);
INSERT INTO `it_keyword_meaning` VALUES (9, 'someone\'s idea, invention, creation, etc., that can be protected by law from being copied by someone else', 'ความคิดของใครบางคน การประดิษฐ์การสร้างสรรค์ฯลฯที่กฎหมายสามารถปกป้อง มิให้ ผู้อื่นคัดลอกได้', 'dictionary.cambridge.org', 9);
INSERT INTO `it_keyword_meaning` VALUES (10, 'the development, implementation, and maintenance of computer hardware and software systems to organize and communicate information electronically', 'การพัฒนา ดำเนินการ และบำรุงรักษาฮาร์ดแวร์คอมพิวเตอร์และระบบซอฟต์แวร์เพื่อจัดระเบียบและสื่อสารข้อมูลทางอิเล็กทรอนิกส์', 'dictionary.com', 10);
INSERT INTO `it_keyword_meaning` VALUES (11, 'the possibility, capability, or likelihood of something being done or accomplished ', 'ความเป็นไปได้ ความสามารถ หรือความน่าจะเป็นของบางสิ่งที่กำลังจะทำหรือสำเร็จ', 'dictionary.com', 11);
INSERT INTO `it_keyword_meaning` VALUES (12, 'The Unified Modeling Language (UML) is a general-purpose, developmental modeling language in the field of software engineering that is intended to provide a standard way to visualize the design of a system.', 'เป็นภาษาที่ใช้ในการสร้างแบบจำลองภาพทั่วไปเพื่อให้เห็นภาพระบุสร้างและระบบซอฟต์แวร์เอกสาร แม้ว่าโดยทั่วไปแล้ว UML จะใช้เพื่อจำลองระบบซอฟต์แวร์ แต่ก็ไม่ได้จำกัดว่าต้องใช้สำหรับซอฟต์แวร์เท่านั้นยังสามารถใช้เพื่อจำลองระบบที่ไม่ใช่ซอฟต์แวร์ได้ด้วย', 'https://en.wikipedia.org/wiki/Unified_Modeling_Language', 12);
INSERT INTO `it_keyword_meaning` VALUES (13, 'a study of an individual unit, as a person, family, or social group, usually emphasizing developmental issues and relationships with the environment, especially in order to compare a larger group to the individual unit.', 'ศึกษาหน่วย บุคคล ครอบครัว หรือกลุ่มสังคม มักจะเน้นปัญหาการพัฒนาและความสัมพันธ์กับสิ่งแวดล้อม โดยเฉพาะอย่างยิ่งเพื่อเปรียบเทียบกลุ่มใหญ่กับแต่ละหน่วย', 'dictionary.com', 13);
INSERT INTO `it_keyword_meaning` VALUES (14, 'a study of an individual unit, as a person, family, or social group, usually emphasizing developmental issues and relationships with the environment, especially in order to compare a larger group to the individual unit.', 'ศึกษาหน่วย บุคคล ครอบครัว หรือกลุ่มสังคม มักจะเน้นปัญหาการพัฒนาและความสัมพันธ์กับสิ่งแวดล้อม โดยเฉพาะอย่างยิ่งเพื่อเปรียบเทียบกลุ่มใหญ่กับแต่ละหน่วย', 'dictionary.com', 14);
INSERT INTO `it_keyword_meaning` VALUES (15, 'a person who organizes and manages any enterprise, especially a business, usually with considerable initiative and risk.', 'บุคคลที่จัดระเบียบและจัดการองค์กรใด ๆ โดยเฉพาะอย่างยิ่งธุรกิจ มักจะมีความคิดริเริ่มและความเสี่ยงมาก', 'dictionary.com', 15);
INSERT INTO `it_keyword_meaning` VALUES (16, ' a structured method of combining classroom-based education with practical work experience.', 'เป็นระบบการศึกษาที่ผสมผสานการเรียนกับการปฏิบัติงาน เพี่อเสริมคุณภาพของบัณฑิตผ่านประสบการณ์ทํางานในสถานประกอบการ ตามมาตรฐานวิชาการและวิชาชีพ และตรงกับความต้องการของตลาดแรงงาน ', 'https://www.google.com/', 16);
INSERT INTO `it_keyword_meaning` VALUES (17, 'the collection of software that directs a computer\'s operations, controlling and scheduling the execution of other programs, and managing storage, input/output, and communication resources. Abbreviation', 'การรวบรวมซอฟต์แวร์ที่ควบคุมการทำงานของคอมพิวเตอร์ ควบคุมและกำหนดเวลาการดำเนินการของโปรแกรมอื่น และจัดการที่เก็บข้อมูล อินพุต/เอาต์พุต และทรัพยากรการสื่อสาร', 'dictionary.com', 17);
INSERT INTO `it_keyword_meaning` VALUES (18, 'Computers. the parts of a computer program, website, system, network, etc., that the user can see or directly interact with customers', 'ส่วนของโปรแกรมคอมพิวเตอร์ เว็บไซต์ ระบบ เครือข่าย ฯลฯ ที่ผู้ใช้สามารถดูหรือโต้ตอบโดยตรงกับลูกค้า', 'dictionary.com', 18);
INSERT INTO `it_keyword_meaning` VALUES (19, ' a broad term for any system, either physical or software based, that allows a user to connect with a given technology. Many different kinds of user interfaces come with various devices and software programs. Many of them have some basic similarities, alt', 'ซอฟต์แวร์ที่อนุญาตให้ผู้ใช้เชื่อมต่อกับเทคโนโลยีที่กำหนด อินเทอร์เฟซผู้ใช้หลายประเภทมาพร้อมกับอุปกรณ์และโปรแกรมซอฟต์แวร์ที่หลากหลาย', 'techopedia.com', 19);
INSERT INTO `it_keyword_meaning` VALUES (20, 'User experience (UX) is a concept in computing system and application design that studies and evaluates human feelings and expressions when using such systems.', 'แนวคิดในระบบคอมพิวเตอร์และการออกแบบแอปพลิเคชันที่ศึกษาและประเมินความรู้สึกและการแสดงออกของมนุษย์เมื่อใช้ระบบ', 'techopedia.com', 20);
INSERT INTO `it_keyword_meaning` VALUES (21, 'is a branch of computer science that focuses on building and managing technology that can learn to autonomously make decisions and carry out actions on behalf of a human being.', ' เป็นสาขาหนึ่งของวิทยาการคอมพิวเตอร์ที่เน้นการสร้างและจัดการเทคโนโลยีที่สามารถเรียนรู้ที่จะตัดสินใจด้วยตนเองและดำเนินการในนามของมนุษย์', 'techopedia.com', 21);
INSERT INTO `it_keyword_meaning` VALUES (22, 'the ability of a computer program to understand spoken and written human language.', 'คือความสามารถของโปรแกรมคอมพิวเตอร์ในการทำความเข้าใจภาษาพูดและภาษาของมนุษย์', 'techopedia.com', 22);
INSERT INTO `it_keyword_meaning` VALUES (23, 'A machine learning engineer (ML engineer) is an information technology (IT) professional who is responsible for helping to build and maintain an organization\'s machine learning (ML) algorithms and artificial intelligence (AI) systems.', 'เป็นผู้เชี่ยวชาญด้านเทคโนโลยีสารสนเทศ (IT) ซึ่งมีหน้าที่รับผิดชอบในการช่วยสร้างและรักษาอัลกอริทึมการเรียนรู้ของเครื่อง ( ML ) และระบบปัญญาประดิษฐ์ ( AI ) ขององค์กร', 'techopedia.com', 23);
INSERT INTO `it_keyword_meaning` VALUES (24, 'Data science is an interdisciplinary field that uses scientific methods, processes, algorithms and systems to extract or extrapolate knowledge and insights from noisy, structured and unstructured data,[1][2] and apply knowledge from data across a broad ra', 'วิทยาการข้อมูล คือ สาขาสหวิทยาการใหม่ ที่สังเคราะห์และสร้างขึ้นบนพื้นฐานของสถิติ สารสนเทศ คอมพิวเตอร์ การสื่อสาร การจัดการ และสังคมวิทยา เพื่อ การศึกษาข้อมูลและสภาพแวดล้อม เพื่อแปลงข้อมูลให้เป็น ข้อมูลเชิงลึกและใช้ช่วยในการตัดสินใจ ตามแนวความคิด ที่ว่า ข้', 'https://blog.datath.com/data-science/', 24);
INSERT INTO `it_keyword_meaning` VALUES (25, 'A machine learning engineer (ML engineer) is an information technology (IT) professional who is responsible for helping to build and maintain an organization\'s machine learning (ML) algorithms and artificial intelligence (AI) systems.', 'ป็นผู้เชี่ยวชาญด้านเทคโนโลยีสารสนเทศ (IT) ซึ่งมีหน้าที่รับผิดชอบในการช่วยสร้างและรักษาอัลกอริทึมการเรียนรู้ของเครื่อง ( ML ) และระบบปัญญาประดิษฐ์ ( AI ) ขององค์กร', 'techopedia.com', 25);
INSERT INTO `it_keyword_meaning` VALUES (26, 'a procedure used for solving a problem or performing a computation.\r\na procedure used for solving a problem or performing a computation.', 'ขั้นตอนหรือลำดับการประมวลผลในการแก้ปัญหาใดปัญหาหนึ่ง\r\n', 'techopedia.com', 26);
INSERT INTO `it_keyword_meaning` VALUES (27, ' a broad term for any system, either physical or software based, that allows a user to connect with a given technology. Many different kinds of user interfaces come with various devices and software programs. Many of them have some basic similarities, alt', 'ซอฟต์แวร์ที่อนุญาตให้ผู้ใช้เชื่อมต่อกับเทคโนโลยีที่กำหนด อินเทอร์เฟซผู้ใช้หลายประเภทมาพร้อมกับอุปกรณ์และโปรแกรมซอฟต์แวร์ที่หลากหลาย', 'techopedia.com', 27);
INSERT INTO `it_keyword_meaning` VALUES (28, 'User experience (UX) is a concept in computing system and application design that studies and evaluates human feelings and expressions when using such systems.', 'แนวคิดในระบบคอมพิวเตอร์และการออกแบบแอปพลิเคชันที่ศึกษาและประเมินความรู้สึกและการแสดงออกของมนุษย์เมื่อใช้ระบบ', 'techopedia.com', 28);
INSERT INTO `it_keyword_meaning` VALUES (29, 'the development, implementation, and maintenance of computer hardware and software systems to organize and communicate information electronically', 'การพัฒนา ดำเนินการ และบำรุงรักษาฮาร์ดแวร์คอมพิวเตอร์และระบบซอฟต์แวร์เพื่อจัดระเบียบและสื่อสารข้อมูลทางอิเล็กทรอนิกส์', 'dictionary.com', 29);
INSERT INTO `it_keyword_meaning` VALUES (30, 'which in turn facilitated the creation of the internet. Academic research, in addition to American military support, led to the development of ARPANET, in which the decentralization of data and packet-switching technology foreshadowed the rise of the inte', 'อำนวยความสะดวกในการสร้างอินเทอร์เน็ต การวิจัยเชิงวิชาการ นอกเหนือจากการสนับสนุนทางทหารของอเมริกา นำไปสู่การพัฒนาARPANETซึ่งการกระจายอำนาจของข้อมูลและเทคโนโลยีการสลับแพ็คเก็ตคาดการณ์ถึงการเพิ่มขึ้นของอินเทอร์เน็ต และทำให้ภูมิทัศน์สื่อดิจิทัลสมัยใหม่เป็นกรอ', 'techopedia.com', 30);
INSERT INTO `it_keyword_meaning` VALUES (31, 'use of computing technologies for the identification, discovery and analysis of business data - like sales revenue, products, costs and incomes.', 'การใช้เทคโนโลยีการคำนวณเพื่อระบุ ค้นพบ และวิเคราะห์ข้อมูลทางธุรกิจ เช่น รายได้จากการขาย ผลิตภัณฑ์ ต้นทุน และรายได้', 'use of computing technologies for the identification, discovery and analysis of business data - like sales revenue, products, costs and incomes.', 31);
INSERT INTO `it_keyword_meaning` VALUES (32, 'Extract transform load (ETL) is the process of extraction, transformation and loading during database use, but particularly during data storage use. It includes the following sub-processes', 'เป็นกระบวนการดึง แปลง และโหลดระหว่างการใช้ฐานข้อมูล โดยเฉพาะระหว่างการใช้พื้นที่จัดเก็บข้อมูล ประกอบด้วยกระบวนการย่อย', 'techopedia.com', 32);
INSERT INTO `it_keyword_meaning` VALUES (33, ' a multidimensional array of data that serves as a database optimized for OLAP applications and data warehousing. It is a way of storing relevant data in a multidimensional form to make it appear more logical when used to generate reports and facilitate m', 'เป็นอาร์เรย์ข้อมูลหลายมิติที่ทำหน้าที่เป็นฐานข้อมูลที่ปรับให้เหมาะสมสำหรับแอปพลิเคชัน OLAP และคลังข้อมูล เป็นวิธีการจัดเก็บข้อมูลที่เกี่ยวข้องในรูปแบบหลายมิติเพื่อให้ดูมีเหตุผลมากขึ้นเมื่อใช้เพื่อสร้างรายงานและอำนวยความสะดวกในการวิเคราะห์ที่มีประสิทธิภาพม', 'techopedia.com', 33);
INSERT INTO `it_keyword_meaning` VALUES (34, ' refers to computer systems that manage and facilitate transaction-oriented applications, usually involving data entry and retrieval. OLTP frequently uses client/server processing and brokering software involving several companies and/or an entire compute', 'ระบบคอมพิวเตอร์ที่จัดการและอำนวยความสะดวกให้กับแอปพลิเคชันที่เน้นการทำธุรกรรม ซึ่งมักจะเกี่ยวข้องกับการป้อนข้อมูลและการดึงข้อมูล OLTP มักใช้ซอฟต์แวร์ประมวลผลไคลเอ็นต์/เซิร์ฟเวอร์และนายหน้าที่เกี่ยวข้องกับบริษัทหลายแห่ง และ/หรือเครือข่ายคอมพิวเตอร์ทั้งหมด ', 'techopedia.com', 34);
INSERT INTO `it_keyword_meaning` VALUES (35, 'A machine learning engineer (ML engineer) is an information technology (IT) professional who is responsible for helping to build and maintain an organization\'s machine learning (ML) algorithms and artificial intelligence (AI) systems.', 'เป็นผู้เชี่ยวชาญด้านเทคโนโลยีสารสนเทศ (IT) ซึ่งมีหน้าที่รับผิดชอบในการช่วยสร้างและรักษาอัลกอริทึมการเรียนรู้ของเครื่อง ( ML ) และระบบปัญญาประดิษฐ์ ( AI ) ขององค์กร', 'techopedia.com', 35);
INSERT INTO `it_keyword_meaning` VALUES (36, 'A Bayesian filter is a computer program using Bayesian logic or Bayesian analysis, which are synonymous terms. It is used to evaluate the header and content of email messages and determine whether or not it constitutes spam – unsolicited email or the elec', 'ป็นโปรแกรมคอมพิวเตอร์ที่ใช้ตรรกะแบบเบย์หรือการวิเคราะห์แบบเบย์ ซึ่งเป็นคำที่มีความหมายเหมือนกัน ใช้เพื่อประเมินส่วนหัวและเนื้อหาของข้อความอีเมล และพิจารณาว่าข้อความนั้นเป็นสแปมหรือไม่ - อีเมลที่ไม่พึงประสงค์หรือเทียบเท่าทางอิเล็กทรอนิกส์ของอีเมลขยะหรืออีเ', 'techopedia.com', 36);
INSERT INTO `it_keyword_meaning` VALUES (37, 'A procedure used for solving a problem or performing a computation.', 'ขั้นตอนหรือลำดับการประมวลผลในการแก้ปัญหาใดปัญหาหนึ่ง\r\nขั้นตอนหรือลำดับการประมวลผลในการแก้ปัญหาใดปัญหาหนึ่ง', 'techopedia.com', 37);
INSERT INTO `it_keyword_meaning` VALUES (38, 'Programming logic is a fundamental construct that\'s applied to computer science in a variety of comprehensive ways.Programming logic involves logical operations on hard data that works according to logical principles and quantifiable results.', 'การเขียนโปรแกรมเป็นโครงสร้างพื้นฐานที่ใช้กับวิทยาการคอมพิวเตอร์ในรูปแบบต่างๆ ที่ครอบคลุมตรรกะของการเขียนโปรแกรมเกี่ยวข้องกับการดำเนินการเชิงตรรกะกับข้อมูลที่ยากซึ่งทำงานตามหลักการทางตรรกะและผลลัพธ์เชิงปริมาณ', 'techopedia.com', 38);
INSERT INTO `it_keyword_meaning` VALUES (39, 'actions that a computer performs, such as comparing and matching, that involve simple yes or no choices, rather than more complicated mathematics', 'องค์ประกอบภาษาที่ช่วยในการสร้างปริมาณ ซึ่งเป็นโครงสร้างที่กล่าวถึงจำนวนตัวอย่างในขอบเขตของวาทกรรมที่กำหนดซึ่งเป็นไปตามสูตรเปิดที่กำหนด Quantifiers ส่วนใหญ่จะใช้ในตรรกะ ภาษาธรรมชาติ และคณิตศาสตร์แบบไม่ต่อเนื่อง', 'techopedia.com', 39);
INSERT INTO `it_keyword_meaning` VALUES (40, ' the ability to consider something in a new way. Creative thinking includes analysis, open-mindedness, problem-solving, organization, and communication. Many employers value creative thinkers, so consider highlighting your creative thinking skills on your', 'ความสามารถในการพิจารณาบางสิ่งในรูปแบบใหม่ ความคิดสร้างสรรค์ ได้แก่ การวิเคราะห์ การเปิดใจ การแก้ปัญหา การจัดระเบียบ และการสื่อสาร', 'google.com', 40);
INSERT INTO `it_keyword_meaning` VALUES (41, 'A web-based application is any program that is accessed over a network connection using HTTP, rather than existing within a device’s memory. Web-based applications often run inside a web browser. However, web-based applications also may be client-based, w', 'แอปพลิเคชันบนเว็บคือโปรแกรมใดๆ ที่เข้าถึงผ่านการเชื่อมต่อเครือข่ายโดยใช้ HTTP แทนที่จะมีอยู่ในหน่วยความจำของอุปกรณ์ แอปพลิเคชันบนเว็บมักจะทำงานภายในเว็บเบราว์เซอร์ อย่างไรก็ตาม แอปพลิเคชันบนเว็บอาจเป็นแบบไคลเอ็นต์ด้วย โดยที่ส่วนเล็กๆ ของโปรแกรมถูกดาวน์โหล', 'techopedia.com', 41);
INSERT INTO `it_keyword_meaning` VALUES (42, 'Rendering is the process involved in the generation of a two-dimensional or three-dimensional image from a model by means of application programs. Rendering is mostly used in architectural designs, video games, and animated movies, simulators, TV special ', 'การแสดงผลเป็นกระบวนการที่เกี่ยวข้องกับการสร้างภาพสองมิติหรือสามมิติจากแบบจำลองโดยใช้โปรแกรมแอปพลิเคชัน การเรนเดอร์ส่วนใหญ่จะใช้ในการออกแบบสถาปัตยกรรม วิดีโอเกม และภาพยนตร์แอนิเมชั่น เครื่องจำลอง เอฟเฟกต์พิเศษของทีวี และการแสดงภาพการออกแบบ เทคนิคและคุณสมบั', 'techopedia.com', 42);
INSERT INTO `it_keyword_meaning` VALUES (43, 'a study of an individual unit, as a person, family, or social group, usually emphasizing developmental issues and relationships with the environment, especially in order to compare a larger group to the individual unit.', 'ศึกษาหน่วย บุคคล ครอบครัว หรือกลุ่มสังคม มักจะเน้นปัญหาการพัฒนาและความสัมพันธ์กับสิ่งแวดล้อม โดยเฉพาะอย่างยิ่งเพื่อเปรียบเทียบกลุ่มใหญ่กับแต่ละหน่วย', 'dictionary.com', 43);
INSERT INTO `it_keyword_meaning` VALUES (44, 'Computing is the process of using computer technology to complete a given goal-oriented task. Computing may encompass the design and development of software and hardware systems for a broad range of purposes - often structuring, processing and managing an', 'คอมพิวเตอร์เป็นกระบวนการของการใช้เทคโนโลยีคอมพิวเตอร์เพื่อทำงานที่มุ่งเน้นเป้าหมายให้สำเร็จ คอมพิวเตอร์อาจรวมถึงการออกแบบและพัฒนาระบบซอฟต์แวร์และฮาร์ดแวร์เพื่อวัตถุประสงค์ที่หลากหลาย ซึ่งมักจะเป็นการจัดโครงสร้าง การประมวลผล และการจัดการข้อมูลประเภทใดก็ตาม', 'techopedia.com', 44);
INSERT INTO `it_keyword_meaning` VALUES (45, 'Computing is the process of using computer technology to complete a given goal-oriented task. Computing may encompass the design and development of software and hardware systems for a broad range of purposes - often structuring, processing and managing an', 'คอมพิวเตอร์เป็นกระบวนการของการใช้เทคโนโลยีคอมพิวเตอร์เพื่อทำงานที่มุ่งเน้นเป้าหมายให้สำเร็จ คอมพิวเตอร์อาจรวมถึงการออกแบบและพัฒนาระบบซอฟต์แวร์และฮาร์ดแวร์เพื่อวัตถุประสงค์ที่หลากหลาย ซึ่งมักจะเป็นการจัดโครงสร้าง การประมวลผล และการจัดการข้อมูลประเภทใดก็ตาม', 'techopedia.com', 45);
INSERT INTO `it_keyword_meaning` VALUES (46, 'the process of writing code to facilitate specific actions in a computer, application or software program, and instructs them on how to perform.', 'ชุดคำสั่งที่นักเขียนโปรแกรม หรือโปรแกรมเมอร์ (Programmer) เขียนโปรแกรมซอร์สโค้ด (Source Code) ที่ถูกต้องตามหลักไวยากรณ์ของภาษาโปรแกรมคอมพิวเตอร์ เพื่อให้สามารถติดต่อสื่อสาร ควบคุมการรับส่งข้อมูล และสั่งให้คอมพิวเตอร์ทำงานตามที่นักเขียนโปรแกรมต้องการได้', 'google.com', 46);
INSERT INTO `it_keyword_meaning` VALUES (47, 'A database management system (DBMS) is a software package designed to store, retrieve, query and manage data.', 'ชุดซอฟต์แวร์ที่ออกแบบมาเพื่อจัดเก็บ เรียกค้น สืบค้น และจัดการข้อมูล ชุดซอฟต์แวร์ที่ออกแบบมาเพื่อจัดเก็บ เรียกค้น สืบค้น และจัดการข้อมูลอนุญาตให้สร้าง อ่าน อัปเดต และลบข้อมูลโดยหน่วยงานที่ได้รับอนุญาต', 'techopedia.com', 47);
INSERT INTO `it_keyword_meaning` VALUES (48, 'A language used to write instructions for the computer. It lets the programmer express data processing in a symbolic manner without regard to machine-specific details.', 'ภาษาที่ใช้เขียนคำสั่งสำหรับคอมพิวเตอร์ ช่วยให้โปรแกรมเมอร์แสดงการประมวลผลข้อมูลในลักษณะสัญลักษณ์โดยไม่คำนึงถึงรายละเอียดเฉพาะเครื่อง', 'google.com', 48);
INSERT INTO `it_keyword_meaning` VALUES (49, 'a procedure used for solving a problem or performing a computation.', 'ขั้นตอนหรือลำดับการประมวลผลในการแก้ปัญหาใดปัญหาหนึ่ง\r\nขั้นตอนหรือลำดับการประมวลผลในการแก้ปัญหาใดปัญหาหนึ่ง', 'techopedia.com', 49);
INSERT INTO `it_keyword_meaning` VALUES (50, 'A brute force attack is a trial-and-error method used to obtain information such as a user password or personal identification number', 'การโจมตีด้วยกำลังเดรัจฉานเป็นวิธีการทดลองและข้อผิดพลาดที่ใช้เพื่อรับข้อมูล เช่น รหัสผ่านของผู้ใช้หรือหมายเลขประจำตัวส่วนบุคคล ', 'techopedia.com', 50);
INSERT INTO `it_keyword_meaning` VALUES (51, 'Non-deterministic polynomial time (NP) is actually a marker used to point to a set of problems and bounds of the capability of certain types of computing. NP refers to the set of problems that can be solved in polynomial time by a non-deterministic Turing', 'เป็นเครื่องหมายที่ใช้เพื่อชี้ไปยังชุดของปัญหาและขอบเขตของความสามารถของการคำนวณบางประเภท NP หมายถึงชุดของปัญหาที่สามารถแก้ไขได้ในเวลาพหุนามด้วยเครื่องทัวริงที่ไม่ได้กำหนดไว้', 'techopedia.com', 51);
INSERT INTO `it_keyword_meaning` VALUES (52, 'a high-level computer programming language that implements objects and their associated procedures within the programming context to create software programs.', 'เป็นภาษาการเขียนโปรแกรมคอมพิวเตอร์ระดับสูงที่ใช้วัตถุและขั้นตอนที่เกี่ยวข้องภายในบริบทการเขียนโปรแกรมเพื่อสร้างโปรแกรมซอฟต์แวร์', 'techopedia.com', 52);
INSERT INTO `it_keyword_meaning` VALUES (53, 'A Java object is a member (also called an instance) of a Java class. Each object has an identity, a behavior and a state.', 'เป็นสมาชิกของคลาส Java แต่ละอ็อบเจ็กต์มีเอกลักษณ์ พฤติกรรม และสถานะ', 'techopedia.com', 53);
INSERT INTO `it_keyword_meaning` VALUES (54, 'Input/Output operations such as open, close, read, write and append, all of which deal with standard disk or tape files.', 'เป็นปฎิบัติการรับและส่งข้อมูล เช่น เปิด ปิด อ่าน เขียน และเพิ่ม ที่จัดการกับ Disk และ Tape file', 'https://www.pcmag.com/encyclopedia/term/file-io', 54);
INSERT INTO `it_keyword_meaning` VALUES (55, 'A database management system (DBMS) is a software package designed to store, retrieve, query and manage data.', 'ชุดซอฟต์แวร์ที่ออกแบบมาเพื่อจัดเก็บ เรียกค้น สืบค้น และจัดการข้อมูล ชุดซอฟต์แวร์ที่ออกแบบมาเพื่อจัดเก็บ เรียกค้น สืบค้น และจัดการข้อมูลอนุญาตให้สร้าง อ่าน อัปเดต และลบข้อมูลโดยหน่วยงานที่ได้รับอนุญาต', 'techopedia.com', 55);
INSERT INTO `it_keyword_meaning` VALUES (56, 'A web-based application is any program that is accessed over a network connection using HTTP, rather than existing within a device’s memory. Web-based applications often run inside a web browser. However, web-based applications also may be client-based, w', 'แอปพลิเคชันบนเว็บคือโปรแกรมใดๆ ที่เข้าถึงผ่านการเชื่อมต่อเครือข่ายโดยใช้ HTTP แทนที่จะมีอยู่ในหน่วยความจำของอุปกรณ์ แอปพลิเคชันบนเว็บมักจะทำงานภายในเว็บเบราว์เซอร์ อย่างไรก็ตาม แอปพลิเคชันบนเว็บอาจเป็นแบบไคลเอ็นต์ด้วย โดยที่ส่วนเล็กๆ ของโปรแกรมถูกดาวน์โหล', 'techopedia.com', 56);
INSERT INTO `it_keyword_meaning` VALUES (57, 'a study of an individual unit, as a person, family, or social group, usually emphasizing developmental issues and relationships with the environment, especially in order to compare a larger group to the individual unit.', 'ศึกษาหน่วย บุคคล ครอบครัว หรือกลุ่มสังคม มักจะเน้นปัญหาการพัฒนาและความสัมพันธ์กับสิ่งแวดล้อม โดยเฉพาะอย่างยิ่งเพื่อเปรียบเทียบกลุ่มใหญ่กับแต่ละหน่วย', 'dictionary.com', 57);
INSERT INTO `it_keyword_meaning` VALUES (58, ' the forecasting and evaluation of financial risks together with the identification of procedures to avoid or minimize their impact.', 'การพยากรณ์และการประเมินความเสี่ยงทางการเงินพร้อมกับการระบุขั้นตอนเพื่อหลีกเลี่ยงหรือลดผลกระทบ', 'google.com', 58);
INSERT INTO `it_keyword_meaning` VALUES (59, 'the maintenance of a desired level of quality in a service or product, especially by means of attention to every stage of the process of delivery or production.', 'การรักษาระดับคุณภาพที่ต้องการในบริการหรือผลิตภัณฑ์ โดยเฉพาะอย่างยิ่งโดยการใส่ใจในทุกขั้นตอนของกระบวนการจัดส่งหรือการผลิต', 'google.com', 59);
INSERT INTO `it_keyword_meaning` VALUES (60, 'A database management system (DBMS) is a software package designed to store, retrieve, query and manage data.', 'ชุดซอฟต์แวร์ที่ออกแบบมาเพื่อจัดเก็บ เรียกค้น สืบค้น และจัดการข้อมูล ชุดซอฟต์แวร์ที่ออกแบบมาเพื่อจัดเก็บ เรียกค้น สืบค้น และจัดการข้อมูลอนุญาตให้สร้าง อ่าน อัปเดต และลบข้อมูลโดยหน่วยงานที่ได้รับอนุญาต', 'techopedia.com', 60);
INSERT INTO `it_keyword_meaning` VALUES (61, 'A database management system (DBMS) is a software package designed to store, retrieve, query and manage data.', 'ชุดซอฟต์แวร์ที่ออกแบบมาเพื่อจัดเก็บ เรียกค้น สืบค้น และจัดการข้อมูล ชุดซอฟต์แวร์ที่ออกแบบมาเพื่อจัดเก็บ เรียกค้น สืบค้น และจัดการข้อมูลอนุญาตให้สร้าง อ่าน อัปเดต และลบข้อมูลโดยหน่วยงานที่ได้รับอนุญาต', 'techopedia.com', 61);
INSERT INTO `it_keyword_meaning` VALUES (62, ' a programming language that is typically used in relational database or data stream management systems.', 'เป็นภาษาการเขียนโปรแกรมที่มักใช้ในฐานข้อมูลเชิงสัมพันธ์หรือระบบการจัดการสตรีมข้อมูล', 'techopedia.com', 62);
INSERT INTO `it_keyword_meaning` VALUES (63, 'An entity relationship diagram (ERD), also known as an entity relationship model, is a graphical representation that depicts relationships among people, objects, places, concepts or events within an information technology (IT) system.', 'การแสดงภาพกราฟิกที่แสดงถึงความสัมพันธ์ระหว่างบุคคล วัตถุ สถานที่ แนวคิดหรือเหตุการณ์ภายในระบบเทคโนโลยีสารสนเทศ (IT )', 'techopedia.com', 63);
INSERT INTO `it_keyword_meaning` VALUES (64, 'a database structured to recognize relations among stored items of information.', 'ฐานข้อมูลที่มีโครงสร้างเพื่อรับรู้ความสัมพันธ์ระหว่างรายการที่จัดเก็บของข้อมูล', 'techopedia.com', 64);
INSERT INTO `it_keyword_meaning` VALUES (65, 'Internet Protocol (IP) is the principal set of digital message formats and rules for exchanging messages between computers across a single network or a series of interconnected networks, using the Internet Protocol Suite (often referred to as TCP/IP). Mes', 'เป็นชุดหลักของรูปแบบข้อความดิจิทัลและกฎสำหรับการแลกเปลี่ยนข้อความระหว่างคอมพิวเตอร์ผ่านเครือข่ายเดียวหรือชุดของเครือข่ายที่เชื่อมต่อถึงกัน', 'techopedia.com', 65);
INSERT INTO `it_keyword_meaning` VALUES (66, 'Model is a conceptual and logical layout that defines network communication used by systems open to interconnection and communication with other systems.', 'เป็นโครงร่างแนวคิดและตรรกะที่กำหนดการสื่อสารเครือข่ายที่ใช้โดยระบบที่เปิดกว้างสำหรับการเชื่อมต่อโครงข่ายและการสื่อสารกับระบบอื่นๆ', 'techopedia.com', 66);
INSERT INTO `it_keyword_meaning` VALUES (67, 'the language a computer uses to access the internet. It consists of a suite of protocols designed to establish a network of networks to provide a host with access to the internet.', 'เป็นภาษาที่คอมพิวเตอร์ใช้ในการเข้าถึงอินเทอร์เน็ต ประกอบด้วยชุดโปรโตคอลที่ออกแบบมาเพื่อสร้างเครือข่ายเพื่อให้โฮสต์สามารถเข้าถึงอินเทอร์เน็ตได้', 'techopedia.com', 67);
INSERT INTO `it_keyword_meaning` VALUES (68, 'a PBX system that is built over IP-based architecture for delivering and managing voice communication services.', 'เป็นระบบ PBX ที่สร้างขึ้นบนสถาปัตยกรรมแบบ IP สำหรับการส่งมอบและจัดการบริการสื่อสารด้วยเสียง', 'techopedia.com', 68);
INSERT INTO `it_keyword_meaning` VALUES (69, 'a study of an individual unit, as a person, family, or social group, usually emphasizing developmental issues and relationships with the environment, especially in order to compare a larger group to the individual unit.', 'ศึกษาหน่วย บุคคล ครอบครัว หรือกลุ่มสังคม มักจะเน้นปัญหาการพัฒนาและความสัมพันธ์กับสิ่งแวดล้อม โดยเฉพาะอย่างยิ่งเพื่อเปรียบเทียบกลุ่มใหญ่กับแต่ละหน่วย', 'dictionary.com', 69);
INSERT INTO `it_keyword_meaning` VALUES (70, 'isualization or visualisation is any technique for creating images, diagrams, or animations to communicate a message.', 'การนำข้อมูลดิบ มาวิเคราะห์และแสดงผลข้อมูลออกมาในรูปแบบของกราฟ แผนภูมิ', 'techopedia.com', 70);
INSERT INTO `it_keyword_meaning` VALUES (71, 'a collection of small applications and tools that are meant to process and then subsequently present statistical data with the aim of making it readily understandable for human readers.', 'ชุดของแอปพลิเคชันและเครื่องมือขนาดเล็กที่มีไว้เพื่อประมวลผลแล้วจึงนำเสนอข้อมูลทางสถิติโดยมีวัตถุประสงค์เพื่อให้ผู้อ่านที่เป็นมนุษย์เข้าใจได้ง่าย', 'techopedia.com', 71);
INSERT INTO `it_keyword_meaning` VALUES (72, 'a plotting library available for the Python programming language as a component of NumPy, a big data numerical handling resource.', 'เป็นไลบรารีการพล็อตที่มีให้สำหรับภาษาการเขียนโปรแกรม Python เป็นส่วนประกอบของ NumPy ซึ่งเป็นทรัพยากรการจัดการตัวเลขขนาดใหญ่', 'techopedia.com', 72);
INSERT INTO `it_keyword_meaning` VALUES (73, 'A knowledge management system (KMS) is a centralized repository that’s used to organize, store and share organizational knowledge with employees and customers.', 'ระบบการจัดการความรู้ (KMS) คือคลังข้อมูลส่วนกลางที่ใช้ในการจัดระเบียบ จัดเก็บ และแบ่งปันความรู้ขององค์กรกับพนักงานและลูกค้า', 'techopedia.com', 73);
INSERT INTO `it_keyword_meaning` VALUES (74, 'A database management system (DBMS) is a software package designed to store, retrieve, query and manage data.', 'ชุดซอฟต์แวร์ที่ออกแบบมาเพื่อจัดเก็บ เรียกค้น สืบค้น และจัดการข้อมูล ชุดซอฟต์แวร์ที่ออกแบบมาเพื่อจัดเก็บ เรียกค้น สืบค้น และจัดการข้อมูลอนุญาตให้สร้าง อ่าน อัปเดต และลบข้อมูลโดยหน่วยงานที่ได้รับอนุญาต', 'techopedia.com', 74);
INSERT INTO `it_keyword_meaning` VALUES (75, 'A clinical decision support system (CDSS) is a type of software system that supports the decision-making of a clinician or health care professional. These systems are commonly defined as any type of application system that presents analytical data to help', 'ระบบสนับสนุนการตัดสินใจทางคลินิก (CDSS) เป็นระบบซอฟต์แวร์ประเภทหนึ่งที่สนับสนุนการตัดสินใจของแพทย์หรือผู้เชี่ยวชาญด้านการดูแลสุขภาพ ระบบเหล่านี้มักถูกกำหนดให้เป็นระบบแอปพลิเคชันประเภทใดก็ได้ที่นำเสนอข้อมูลการวิเคราะห์เพื่อช่วยแพทย์หรือผู้เชี่ยวชาญทางการแพ', 'techopedia.com', 75);
INSERT INTO `it_keyword_meaning` VALUES (76, 'he interpretation of a group of ideas within a specific domain that defines the interrelationship between those ideas. Ontology can be used to study the existence of entities within a specific domain and sometimes can be used to identify the domain itself', 'การตีความกลุ่มความคิดภายในโดเมนเฉพาะที่กำหนดความสัมพันธ์ระหว่างความคิดเหล่านั้น Ontology สามารถใช้เพื่อศึกษาการมีอยู่ของเอนทิตีภายในโดเมนเฉพาะ และบางครั้งสามารถใช้เพื่อระบุโดเมนได้', 'techopedia.com', 76);
INSERT INTO `it_keyword_meaning` VALUES (77, 'A web-based application is any program that is accessed over a network connection using HTTP, rather than existing within a device’s memory. Web-based applications often run inside a web browser. However, web-based applications also may be client-based, w', 'แอปพลิเคชันบนเว็บคือโปรแกรมใดๆ ที่เข้าถึงผ่านการเชื่อมต่อเครือข่ายโดยใช้ HTTP แทนที่จะมีอยู่ในหน่วยความจำของอุปกรณ์ แอปพลิเคชันบนเว็บมักจะทำงานภายในเว็บเบราว์เซอร์ อย่างไรก็ตาม แอปพลิเคชันบนเว็บอาจเป็นแบบไคลเอ็นต์ด้วย โดยที่ส่วนเล็กๆ ของโปรแกรมถูกดาวน์โหล', 'techopedia.com', 77);
INSERT INTO `it_keyword_meaning` VALUES (78, 'refers to any computer programming language that requests and retrieves data from database and information systems by sending queries. It works on user entered structured and formal programming command based queries to find and extract data from host data', 'ภาษาการเขียนโปรแกรมคอมพิวเตอร์ที่ร้องขอและดึงข้อมูลจากฐานข้อมูลและระบบสารสนเทศโดยการส่งแบบสอบถาม มันทำงานบนผู้ใช้ที่ป้อนคำสั่งการเขียนโปรแกรมที่มีโครงสร้างและเป็นทางการเพื่อค้นหาและดึงข้อมูลจากฐานข้อมูลโฮสต์', 'techopedia.com', 78);
INSERT INTO `it_keyword_meaning` VALUES (79, 'also known as machine intelligence, is a branch of computer science that focuses on building and managing technology that can learn to autonomously make decisions and carry out actions on behalf of a human being.', 'เป็นสาขาหนึ่งของวิทยาการคอมพิวเตอร์ที่เน้นการสร้างและจัดการเทคโนโลยีที่สามารถเรียนรู้ที่จะตัดสินใจด้วยตนเองและดำเนินการในนามของมนุษย์', 'techopedia.com', 79);
INSERT INTO `it_keyword_meaning` VALUES (80, 'There is a significant opportunity to explore and expand the possibilities of testing and quality assurance into the field of data science and machine learning (ML).', 'การสำรวจและขยายความเป็นไปได้ของการทดสอบและการประกันคุณภาพในด้านวิทยาศาสตร์ข้อมูลและการเรียนรู้ของเครื่อง (ML)', 'techopedia.com', 80);
INSERT INTO `it_keyword_meaning` VALUES (81, 'also known as machine intelligence, is a branch of computer science that focuses on building and managing technology that can learn to autonomously make decisions and carry out actions on behalf of a human being.', 'เป็นสาขาหนึ่งของวิทยาการคอมพิวเตอร์ที่เน้นการสร้างและจัดการเทคโนโลยีที่สามารถเรียนรู้ที่จะตัดสินใจด้วยตนเองและดำเนินการในนามของมนุษย์', 'techopedia.com', 81);
INSERT INTO `it_keyword_meaning` VALUES (82, 'Data science is a broad field that refers to the collective processes, theories, concepts, tools and technologies that enable the review, analysis and extraction of valuable knowledge and information from raw data. It is geared toward helping individuals ', 'วิทยาศาสตร์ข้อมูลเป็นสาขากว้างๆ ที่อ้างอิงถึงกระบวนการ ทฤษฎี แนวคิด เครื่องมือและเทคโนโลยีร่วมกัน ซึ่งช่วยให้สามารถทบทวน วิเคราะห์ และดึงความรู้และข้อมูลที่มีคุณค่าจากข้อมูลดิบได้ โดยมุ่งไปที่การช่วยเหลือบุคคลและองค์กรในการตัดสินใจที่ดีขึ้นจากข้อมูลที่จัด', 'techopedia.com', 82);
INSERT INTO `it_keyword_meaning` VALUES (83, ' a computing concept that describes the idea of everyday physical objects being connected to the internet and being able to identify themselves to other devices and send and receive data. The term is closely identified with radio frequency identification ', 'เป็นแนวคิดการคำนวณที่อธิบายแนวคิดของวัตถุทางกายภาพในชีวิตประจำวันที่เชื่อมต่อกับอินเทอร์เน็ตและสามารถระบุตัวเองกับอุปกรณ์อื่นและส่งและรับข้อมูลได้ คำนี้มีการระบุอย่างใกล้ชิดโดยใช้การระบุความถี่วิทยุ (RFID) เป็นวิธีการสื่อสาร แม้ว่าอาจรวมถึงเทคโนโลยีเซ็นเซ', 'techopedia.com', 83);
INSERT INTO `it_keyword_meaning` VALUES (84, 's your go-to tech source for professional IT insight and inspiration. We aim to be a site that isn\'t trying to be the first to break news stories', ' เป็นแหล่งข้อมูลด้านเทคโนโลยีที่คุณไม่ควรพลาดสำหรับข้อมูลเชิงลึกและแรงบันดาลใจด้านไอทีอย่างมืออาชีพ เรามุ่งมั่นที่จะเป็นเว็บไซต์ที่ไม่พยายามเป็นเจ้าแรกในการทำลายข่าว', 'techopedia.com', 84);
INSERT INTO `it_keyword_meaning` VALUES (85, 'GPRS Tunneling Protocol (GTP) is an Internet Protocol (IP) based protocol suite used to carry general packet radio service (GPRS) within the following network', 'เป็นชุดโปรโตคอลที่ใช้ Internet Protocol (IP) ที่ใช้เพื่อให้บริการวิทยุแพ็คเก็ตทั่วไป (GPRS) ภายในเครือข่าย', 'techopedia.com', 85);
INSERT INTO `it_keyword_meaning` VALUES (86, 'A database management system (DBMS) is a software package designed to store, retrieve, query and manage data.', 'ชุดซอฟต์แวร์ที่ออกแบบมาเพื่อจัดเก็บ เรียกค้น สืบค้น และจัดการข้อมูล ชุดซอฟต์แวร์ที่ออกแบบมาเพื่อจัดเก็บ เรียกค้น สืบค้น และจัดการข้อมูลอนุญาตให้สร้าง อ่าน อัปเดต และลบข้อมูลโดยหน่วยงานที่ได้รับอนุญาต', 'techopedia.com', 86);
INSERT INTO `it_keyword_meaning` VALUES (87, 'a software interface that allows developers to link cloud computing services together. Application programming interfaces (APIs) allow one computer program to make its data and functionality available for other programs to use. Developers use APIs to conn', 'อินเทอร์เฟซซอฟต์แวร์ที่ช่วยให้นักพัฒนาสามารถเชื่อมโยง บริการการ ประมวลผลแบบคลาวด์เข้าด้วยกัน Application Programming Interface ( API ) อนุญาตให้โปรแกรมคอมพิวเตอร์เครื่องหนึ่งสร้างข้อมูลและฟังก์ชันสำหรับโปรแกรมอื่นๆ ได้ นักพัฒนาใช้ API เพื่อเชื่อมต่อส่วนปร', 'techopedia.com', 87);
INSERT INTO `it_keyword_meaning` VALUES (88, 'the set of software and hardware that allows computer systems, network devices or machines to function without any manual intervention. ASOs allow computer systems to work without a human operator physically located at the site where the system is install', 'ชุดของซอฟต์แวร์และฮาร์ดแวร์ที่ช่วยให้ระบบคอมพิวเตอร์ อุปกรณ์เครือข่าย หรือเครื่องจักรทำงานได้โดยไม่ต้องมีการแทรกแซงด้วยตนเอง ASO อนุญาตให้ระบบคอมพิวเตอร์ทำงานโดยไม่ต้องมีเจ้าหน้าที่ควบคุมอยู่ที่ไซต์ที่ติดตั้งระบบ การทำงานของระบบอัตโนมัติเป็นส่วนหนึ่งของกา', 'techopedia.com', 88);
INSERT INTO `it_keyword_meaning` VALUES (89, 'the process of analyzing user needs and designing, constructing, and testing end-user applications that will satisfy these needs through the use of software programming languages. It is the application of engineering principles to software development.', 'กระบวนการของการวิเคราะห์ความต้องการของผู้ใช้และการออกแบบ สร้าง และทดสอบแอปพลิเคชันของผู้ใช้ปลายทางที่จะตอบสนองความต้องการเหล่านี้ผ่านการใช้ภาษาการเขียนโปรแกรมซอฟต์แวร์ เป็นการนำหลักวิศวกรรมมาประยุกต์ใช้ในการพัฒนาซอฟต์แวร์', 'techopedia.com', 89);
INSERT INTO `it_keyword_meaning` VALUES (90, 'In databases, data retrieval is the process of identifying and extracting data from a database, based on a query provided by the user or application.', 'ฐานข้อมูล การดึงข้อมูลเป็นกระบวนการในการระบุและดึงข้อมูลจากฐานข้อมูล โดยยึดตามการสืบค้นที่ผู้ใช้หรือแอปพลิเคชันให้มา', 'techopedia.com', 90);
INSERT INTO `it_keyword_meaning` VALUES (91, 'Search engine traffic refers to the visitors who arrive at a website by clicking search results leading to that particular website. Using a Web analytics program, a website’s overall search engine traffic can be segmented to show the percentage of search ', 'ปริมาณการใช้เครื่องมือค้นหาหมายถึงผู้เข้าชมที่มาถึงเว็บไซต์โดยคลิกผลการค้นหาที่นำไปสู่เว็บไซต์นั้น การใช้โปรแกรมวิเคราะห์เว็บ สามารถแบ่งกลุ่มการเข้าชมเครื่องมือค้นหาโดยรวมของเว็บไซต์เพื่อแสดงเปอร์เซ็นต์ของการเข้าชมเครื่องมือค้นหาสำหรับแต่ละหน้าเว็บหรือส่ว', 'techopedia.com', 91);
INSERT INTO `it_keyword_meaning` VALUES (92, 'An application that searches the Web using existing search engines.', 'แอปพลิเคชั่นที่ค้นหาเว็บโดยใช้เครื่องมือค้นหาที่มีอยู่', 'google.com', 92);
INSERT INTO `it_keyword_meaning` VALUES (93, 'the branch of linguistics in which the techniques of computer science are applied to the analysis and synthesis of language and speech.', 'สาขาภาษาศาสตร์ซึ่งนำเทคนิคของวิทยาการคอมพิวเตอร์มาประยุกต์ใช้ในการวิเคราะห์และการสังเคราะห์ภาษาและคำพูด', 'techopedia.com', 93);
INSERT INTO `it_keyword_meaning` VALUES (94, 'a machine that performs a function according to a predetermined set of coded instructions, especially one capable of a range of programmed responses to different circumstances.', 'เครื่องมือหรืออุปกรณ์คำนวณชนิดหนึ่งซึ่งมีหน่วยความจำจำกัด (ใช้สถานะจำกัดในการจดจำ) และรับข้อมูลโดยการอ่านแถบบันทึกรับเข้า โดยที่อุปกรณ์ชนิดนี้จะให้คำตอบว่าสายอักขระที่อยู่ในแถบบันทึกรับเข้านั้นยอมรับได้หรือไม่ได้ ', 'dictionary.com', 94);
INSERT INTO `it_keyword_meaning` VALUES (95, 'Natural language processing (NLP) is the ability of a computer program to understand spoken and written human language.', 'การประมวลผลภาษาธรรมชาติ (NLP) คือความสามารถของโปรแกรมคอมพิวเตอร์ในการทำความเข้าใจภาษาพูดและภาษาของมนุษย์', 'techopedia.com', 95);
INSERT INTO `it_keyword_meaning` VALUES (96, 'Natural language processing (NLP) is the ability of a computer program to understand spoken and written human language.', 'การประมวลผลภาษาธรรมชาติ (NLP) คือความสามารถของโปรแกรมคอมพิวเตอร์ในการทำความเข้าใจภาษาพูดและภาษาของมนุษย์', 'techopedia.com', 96);
INSERT INTO `it_keyword_meaning` VALUES (97, 'a procedure used for solving a problem or performing a computation.', 'ขั้นตอนหรือลำดับการประมวลผลในการแก้ปัญหาใดปัญหาหนึ่ง', 'techopedia.com', 97);
INSERT INTO `it_keyword_meaning` VALUES (98, 'frequency and frequency drift', 'ความถี่และ ความเบี่ยงเบนของความถี่ ', 'scholar.google.com', 98);
INSERT INTO `it_keyword_meaning` VALUES (99, 'Natural language processing (NLP) is the ability of a computer program to understand spoken and written human language.', 'การประมวลผลภาษาธรรมชาติ (NLP) คือความสามารถของโปรแกรมคอมพิวเตอร์ในการทำความเข้าใจภาษาพูดและภาษาของมนุษย์', 'techopedia.com', 99);
INSERT INTO `it_keyword_meaning` VALUES (100, ' natural language modeling process that requires changing units of text into units of speech for audio presentation. This is the opposite of speech to text, where a technology takes in spoken words and tries to accurately record them as text. Text to spee', 'กระบวนการสร้างแบบจำลองภาษาธรรมชาติที่ต้องเปลี่ยนหน่วยข้อความเป็นหน่วยคำพูดสำหรับการนำเสนอด้วยเสียง นี่คือสิ่งที่ตรงกันข้ามกับคำพูดเป็นข้อความซึ่งเทคโนโลยีใช้คำพูดและพยายามบันทึกเป็นข้อความอย่างถูกต้อง การแปลงข้อความเป็นคำพูดเป็นเรื่องปกติในเทคโนโลยีที่ต้อ', 'techopedia.com', 100);
INSERT INTO `it_keyword_meaning` VALUES (101, 'a statistical Markov model in which the system being modeled is assumed to be a Markov process — call it — with unobservable', 'แบบจำลองทางสถิติของ Markov ซึ่งระบบที่กำลังสร้างแบบจำลองจะถือว่าเป็นกระบวนการของ Markov ซึ่งเรียกว่ามีสถานะที่ไม่สามารถสังเกตได้', 'google.com', 101);
INSERT INTO `it_keyword_meaning` VALUES (102, 'Natural language processing (NLP) is the ability of a computer program to understand spoken and written human language.', 'การประมวลผลภาษาธรรมชาติ (NLP) คือความสามารถของโปรแกรมคอมพิวเตอร์ในการทำความเข้าใจภาษาพูดและภาษาของมนุษย์', 'techopedia.com', 102);
INSERT INTO `it_keyword_meaning` VALUES (103, ' a computing concept that describes the idea of everyday physical objects being connected to the internet and being able to identify themselves to other devices and send and receive data. ', 'แนวคิดการคำนวณที่อธิบายแนวคิดของวัตถุทางกายภาพในชีวิตประจำวันที่เชื่อมต่อกับอินเทอร์เน็ตและสามารถระบุตัวเองกับอุปกรณ์อื่นและส่งและรับข้อมูลได้ ', 'techopedia.com', 103);
INSERT INTO `it_keyword_meaning` VALUES (104, 'a study of an individual unit, as a person, family, or social group, usually emphasizing developmental issues and relationships with the environment, especially in order to compare a larger group to the individual unit.', 'ศึกษาหน่วย บุคคล ครอบครัว หรือกลุ่มสังคม มักจะเน้นปัญหาการพัฒนาและความสัมพันธ์กับสิ่งแวดล้อม โดยเฉพาะอย่างยิ่งเพื่อเปรียบเทียบกลุ่มใหญ่กับแต่ละหน่วย', 'dictionary.com', 104);
INSERT INTO `it_keyword_meaning` VALUES (105, 'Using AI, cybercriminals can remain dormant and undetected within a company\'s network for extended periods', 'การใช้ AI อาชญากรไซเบอร์สามารถอยู่เฉยๆ และไม่ถูกตรวจจับภายในเครือข่ายของบริษัทเป็นระยะเวลานาน', 'techopedia.com', 105);
INSERT INTO `it_keyword_meaning` VALUES (106, 'the art of writing or solving codes', ' ศิลปะการเขียนหรือการแก้รหัส', 'google.com', 106);
INSERT INTO `it_keyword_meaning` VALUES (107, 'the development, implementation, and maintenance of computer hardware and software systems to organize and communicate information electronically', 'การพัฒนา ดำเนินการ และบำรุงรักษาฮาร์ดแวร์คอมพิวเตอร์และระบบซอฟต์แวร์เพื่อจัดระเบียบและสื่อสารข้อมูลทางอิเล็กทรอนิกส์', 'dictionary.com', 107);
INSERT INTO `it_keyword_meaning` VALUES (108, ' a system designed to capture, analyze, store, manipulate, present and manage all types of geographical data, like information from maps, global positioning systems (GPS) and ubiquitous data, like locations of landmarks and areas hit by calamities.', 'ระบบที่ออกแบบมาเพื่อจับภาพ วิเคราะห์ จัดเก็บ จัดการ นำเสนอ และจัดการข้อมูลทางภูมิศาสตร์ทุกประเภท เช่น ข้อมูลจากแผนที่ ระบบกำหนดตำแหน่งทั่วโลก (GPS) และข้อมูลทั่วไป', 'techopedia.com', 108);
INSERT INTO `it_keyword_meaning` VALUES (109, 'the development, implementation, and maintenance of computer hardware and software systems to organize and communicate information electronically', 'การพัฒนา ดำเนินการ และบำรุงรักษาฮาร์ดแวร์คอมพิวเตอร์และระบบซอฟต์แวร์เพื่อจัดระเบียบและสื่อสารข้อมูลทางอิเล็กทรอนิกส์', 'dictionary.com', 109);
INSERT INTO `it_keyword_meaning` VALUES (110, 'a study of an individual unit, as a person, family, or social group, usually emphasizing developmental issues and relationships with the environment, especially in order to compare a larger group to the individual unit.', 'ศึกษาหน่วย บุคคล ครอบครัว หรือกลุ่มสังคม มักจะเน้นปัญหาการพัฒนาและความสัมพันธ์กับสิ่งแวดล้อม โดยเฉพาะอย่างยิ่งเพื่อเปรียบเทียบกลุ่มใหญ่กับแต่ละหน่วย', 'dictionary.com', 110);
INSERT INTO `it_keyword_meaning` VALUES (111, 'the development, implementation, and maintenance of computer hardware and software systems to organize and communicate information electronically', 'การพัฒนา ดำเนินการ และบำรุงรักษาฮาร์ดแวร์คอมพิวเตอร์และระบบซอฟต์แวร์เพื่อจัดระเบียบและสื่อสารข้อมูลทางอิเล็กทรอนิกส์', 'dictionary.com', 111);
INSERT INTO `it_keyword_meaning` VALUES (112, 'statistical modelling and algorithmic processing to understand biological data. Bioinformatics is an example of how computer science has revolutionized other fields.', 'การใช้วิทยาการคอมพิวเตอร์ การสร้างแบบจำลองทางสถิติ และการประมวลผลอัลกอริธึมเพื่อทำความเข้าใจข้อมูลทางชีววิทยา ชีวสารสนเทศเป็นตัวอย่างหนึ่งของวิทยาการคอมพิวเตอร์ที่ปฏิวัติสาขาอื่นๆ', 'techopedia.com', 112);
INSERT INTO `it_keyword_meaning` VALUES (113, 'A database management system (DBMS) is a software package designed to store, retrieve, query and manage data.', 'ชุดซอฟต์แวร์ที่ออกแบบมาเพื่อจัดเก็บ เรียกค้น สืบค้น และจัดการข้อมูล ชุดซอฟต์แวร์ที่ออกแบบมาเพื่อจัดเก็บ เรียกค้น สืบค้น และจัดการข้อมูลอนุญาตให้สร้าง อ่าน อัปเดต และลบข้อมูลโดยหน่วยงานที่ได้รับอนุญาต', 'techopedia.com', 113);
INSERT INTO `it_keyword_meaning` VALUES (114, 'an electronic circuit that converts power using switching devices that are turned on and off at high frequencies, and storage components such as inductors or capacitors to supply power when the switching device is in its non-conduction state.', 'เป็นวงจรอิเล็กทรอนิกส์ที่แปลงพลังงานโดยใช้อุปกรณ์สวิตช์ที่เปิดและปิดที่ความถี่สูง และส่วนประกอบการจัดเก็บเช่นตัวเหนี่ยวนำหรือตัวเก็บประจุเพื่อจ่ายพลังงานเมื่ออุปกรณ์สวิตช์อยู่ในสถานะไม่นำไฟฟ้า สถานะ.', 'techopedia.com', 114);
INSERT INTO `it_keyword_meaning` VALUES (115, 'an open and free file format as well as an international standard. It is used in 2-D', 'รูปแบบไฟล์เปิดและฟรีตลอดจนมาตรฐานสากล ใช้ในรูปแบบ 2 มิติ', 'techopedia.com', 115);
INSERT INTO `it_keyword_meaning` VALUES (116, 'Iterative game design is the process by which a video game is repeatedly proposed, prototyped, play tested and reevaluated prior to working product release. Iterative game design operates on the following principle: It is unrealistic to create an ideal pr', 'กระบวนการที่วิดีโอเกมได้รับการเสนอ สร้างต้นแบบ ทดสอบการเล่น และประเมินซ้ำหลายครั้งก่อนที่จะมีการเปิดตัวผลิตภัณฑ์ การออกแบบเกมแบบวนซ้ำทำงานบนหลักการดังต่อไปนี้: การสร้างผลิตภัณฑ์ในอุดมคติในครั้งแรกนั้นไม่สมจริง', 'techopedia.com', 116);
INSERT INTO `it_keyword_meaning` VALUES (117, 'a specific type of installations on the Web that are more functional and interactive. The core definition of rich media is that it is a Web page ad that contains video or interactive features.', 'การติดตั้งประเภทใดประเภทหนึ่งบนเว็บที่ใช้งานได้จริงและมีการโต้ตอบมากกว่า คำจำกัดความหลักของสื่อสมบูรณ์คือโฆษณาบนเว็บเพจที่มีวิดีโอหรือคุณลักษณะเชิงโต้ตอบ', 'techopedia.com', 117);
INSERT INTO `it_keyword_meaning` VALUES (118, 'The process of brainstorming, sketching, outlining, and drawing fictionalized persons or non-human beings, often from scratch. ', 'กระบวนการระดมสมอง ร่างภาพ ร่างโครงร่าง และวาดภาพบุคคลที่สมมติขึ้นหรือไม่ใช่มนุษย์ ซึ่งมักจะเริ่มจากศูนย์ นักออกแบบทำให้สิ่งมีชีวิตเหล่านี้มีบุคลิกและลักษณะเฉพาะ เช่น รูปลักษณ์ภายนอก รูปแบบการพูด การเคลื่อนไหว และบุคลิกภาพ', 'google.com', 118);
INSERT INTO `it_keyword_meaning` VALUES (119, 'an open and free file format as well as an international standard. It is used in 2-D', 'รูปแบบไฟล์เปิดและฟรีตลอดจนมาตรฐานสากล ใช้ในรูปแบบ 2 มิติ', 'techopedia.com', 119);
INSERT INTO `it_keyword_meaning` VALUES (120, 'which in turn facilitated the creation of the internet. Academic research, in addition to American military support, led to the development of ARPANET, in which the decentralization of data and packet-switching technology foreshadowed the rise of the inte', 'อำนวยความสะดวกในการสร้างอินเทอร์เน็ต การวิจัยเชิงวิชาการ นอกเหนือจากการสนับสนุนทางทหารของอเมริกา นำไปสู่การพัฒนาARPANETซึ่งการกระจายอำนาจของข้อมูลและเทคโนโลยีการสลับแพ็คเก็ตคาดการณ์ถึงการเพิ่มขึ้นของอินเทอร์เน็ต และทำให้ภูมิทัศน์สื่อดิจิทัลสมัยใหม่เป็นกรอ', 'techopedia.com', 120);
INSERT INTO `it_keyword_meaning` VALUES (121, 'any graphic aide that shows the before-and-after conditions of a proposed project. The before condition is simply an existing view of a site or location.', 'ผู้ช่วยด้านกราฟิกที่แสดงเงื่อนไขก่อนและหลังของโครงการที่เสนอ เงื่อนไข before เป็นเพียงมุมมองที่มีอยู่ของไซต์หรือสถานที่', 'google.com', 121);
INSERT INTO `it_keyword_meaning` VALUES (122, 'the technique of photographing successive drawings or positions of puppets or models to create an illusion of movement when the movie is shown as a sequence.', 'เทคนิคการถ่ายภาพภาพวาดต่อเนื่องกันหรือตำแหน่งของหุ่นกระบอกหรือนางแบบเพื่อสร้างภาพลวงตาของการเคลื่อนไหวเมื่อภาพยนตร์แสดงเป็นซีเควนซ์', 'google.com', 122);
INSERT INTO `it_keyword_meaning` VALUES (123, 'the system of ropes, cables, or chains employed to support a ship\'s masts ( standing rigging ) and to control or set the yards and sails ( running rigging ).', 'ระบบเชือก สายเคเบิล หรือโซ่ที่ใช้รองรับเสากระโดงเรือ ( แท่นยืน ) และเพื่อควบคุมหรือตั้งลานและใบเรือ ( อุปกรณ์วิ่ง )', 'google.com', 123);
INSERT INTO `it_keyword_meaning` VALUES (124, 'a modal logic which extends Propositional Dynamic Logic by. generalising its semantics and adding a new operator to the language.', 'โมดอลลอจิกที่ขยาย Propositional Dynamic Logicโดย สรุปความหมายของมันและเพิ่มโอเปอเรเตอร์ใหม่ให้กับภาษา ตรรกะสามารถ ใช้เพื่อให้เหตุผลเกี่ยวกับเกมผู้เล่น 2 คนที่กำหนด', 'google.com', 124);
INSERT INTO `it_keyword_meaning` VALUES (125, 'a branch of computer science that focuses on building and managing technology that can learn to autonomously make decisions and carry out actions on behalf of a human being.', 'เป็นสาขาหนึ่งของวิทยาการคอมพิวเตอร์ที่เน้นการสร้างและจัดการเทคโนโลยีที่สามารถเรียนรู้ที่จะตัดสินใจด้วยตนเองและดำเนินการในนามของมนุษย์', 'techopedia.com', 125);
INSERT INTO `it_keyword_meaning` VALUES (126, 'AI in gaming refers to responsive and adaptive video game experiences. These AI-powered interactive experiences are usually generated via non-player', 'ประสบการณ์วิดีโอเกมที่ตอบสนองและปรับเปลี่ยนได้ ประสบการณ์เชิงโต้ตอบที่ขับเคลื่อนโดย AI เหล่านี้มักจะสร้างขึ้นผ่านระบบที่ไม่ใช่ผู้เล่น', 'google.com', 126);
INSERT INTO `it_keyword_meaning` VALUES (127, 'an emerging art form in which traditional painting techniques such as watercolor, oils, impasto, etc. are applied using digital tools by means of a computer, a graphics tablet and stylus, and software.', 'รูปแบบศิลปะที่เกิดขึ้นใหม่ซึ่งมีการนำเทคนิคการวาดภาพแบบดั้งเดิม เช่น สีน้ำ น้ำมัน อิมปัสโต ฯลฯ โดยใช้เครื่องมือดิจิทัลโดยใช้คอมพิวเตอร์ แท็บเล็ตกราฟิกและสไตลัส และซอฟต์แวร์', 'google.com', 127);
INSERT INTO `it_keyword_meaning` VALUES (128, 'which in turn facilitated the creation of the internet. Academic research, in addition to American military support, led to the development of ARPANET, in which the decentralization of data and packet-switching technology foreshadowed the rise of the inte', 'อำนวยความสะดวกในการสร้างอินเทอร์เน็ต การวิจัยเชิงวิชาการ นอกเหนือจากการสนับสนุนทางทหารของอเมริกา นำไปสู่การพัฒนาARPANETซึ่งการกระจายอำนาจของข้อมูลและเทคโนโลยีการสลับแพ็คเก็ตคาดการณ์ถึงการเพิ่มขึ้นของอินเทอร์เน็ต และทำให้ภูมิทัศน์สื่อดิจิทัลสมัยใหม่เป็นกรอ', 'techopedia.com', 128);
INSERT INTO `it_keyword_meaning` VALUES (129, 'is an education model that systematically switch classroom learning between practical work experience with a partnership of both public and private industrial enterprises and all involved sectors.', 'ระบบการศึกษาที่จัดให้ มีการ เรียนการสอนในสถานศึกษาสลับกับการไปหาประสบการณ์ตรงจากการปฏิบัติงานจริง ณ สถาน ประกอบการอย่างมีระบบ ด้วยความร่วมมือจากสถานประกอบการและทุกฝ่ายที่เกี่ยวข้อง เป็น ระบบ การศึกษาที่ผสมผสานการเรียนกับการปฏิบัติงาน', 'https://coop.wu.ac.th/?page_id=2887&lang=en', 129);
INSERT INTO `it_keyword_meaning` VALUES (130, ' the convergence of computing, telecommunication and governance policies for how information should be accessed, secured, processed, transmitted and stored.', 'การบรรจบกันของนโยบายการคำนวณ โทรคมนาคม และธรรมาภิบาลสำหรับวิธีการเข้าถึง รักษาความปลอดภัย ประมวลผล ส่งต่อ และจัดเก็บข้อมูล', 'techopedia.com', 130);
INSERT INTO `it_keyword_meaning` VALUES (131, 'the position of a student or trainee who works in an organization, sometimes without pay, in order to gain work experience or satisfy requirements for a qualification.', 'ตำแหน่งของนักเรียนหรือผู้ฝึกงานที่ทำงานในองค์กรบางครั้งโดยไม่ต้องจ่ายเงินเพื่อให้ได้ประสบการณ์การทำงานหรือตอบสนองความต้องการคุณสมบัติ', 'google.com', 131);
INSERT INTO `it_keyword_meaning` VALUES (132, 'part of the ownership of a company that can be bought by members of the public', 'หน่วยลงทุนแต่ละหน่วยที่มีมูลค่าเท่า ๆ กัน ซึ่งรวมกันเป็นทุนเรือนหุ้นของบริษัทจำกัดหรือบริษัทมหาชนจำกัด', NULL, 132);
INSERT INTO `it_keyword_meaning` VALUES (133, 'A bond is a fixed-income investment that represents a loan made by an investor to a borrower, ususally corporate or governmental.', 'เอกสารหลักทรัพย์ชนิดหนึ่งที่ออกโดยรัฐบาลหรือนิติบุคคล แสดงการเป็นหนี้ระยะยาวที่กู้จากบุคคลทั่วไป', NULL, 133);
INSERT INTO `it_keyword_meaning` VALUES (134, 'the job or activity of judging what is likely to happen in the future, based on the information you have now', 'ทำนายหรือคาดการณ์โดยอาศัยหลักวิชา', NULL, 134);
INSERT INTO `it_keyword_meaning` VALUES (135, 'computer language programmers use to develop software programs, scripts, or other sets of instructions for computers to execute.', 'ภาษาประดิษฐ์ชนิดหนึ่งที่ออกแบบขึ้นมาเพื่อสื่อสารชุดคำสั่งแก่เครื่องจักร', NULL, 135);
INSERT INTO `it_keyword_meaning` VALUES (136, 'a high-level computer programming language that implements objects and their associated procedures within the programming context to create software programs.', 'เป็นภาษาการเขียนโปรแกรมคอมพิวเตอร์ระดับสูงที่ใช้วัตถุและขั้นตอนที่เกี่ยวข้องภายในบริบทการเขียนโปรแกรมเพื่อสร้างโปรแกรมซอฟต์แวร์', NULL, 136);
INSERT INTO `it_keyword_meaning` VALUES (137, 'a large amount of information stored in a computer system in such a way that it can be easily looked at or changed', 'ฐานข้อมูลประกอบด้วยกลุ่มการจัดการข้อมูลสำหรับผู้ใช้หนึ่งคนหรือหลายๆ คน โดยทั่วไปมักอยู่ในรูปแบบดิจิทัล', NULL, 137);
INSERT INTO `it_keyword_meaning` VALUES (138, 'a standardized programming language that is used to manage relational databases and perform various operations on the data', 'เป็นภาษาสำหรับใช้ในซอฟต์แวร์ระบบจัดการฐานข้อมูลที่เป็นชนิดฐานข้อมูลเชิงสัมพันธ์', NULL, 138);
INSERT INTO `it_keyword_meaning` VALUES (139, 'type of flowchart that illustrates how “entities” such as people, objects or concepts relate to each other within a system', 'แผนภาพเอนทิตีรีเลชันชิพเป็นการอธิบายโครงสร้างของฐานข้อมูล โดยอธิบายถึงองค์ประกอบและสัญลักษณ์ที่ใช้ใน แผนภาพเอนทิตีรีเลชัน ชิพ ซึ่งเป็นแบบจําลองในระดับหลักการ เป็นเครื่องมือช่วยในการสื่อสาร ระหว่างผู้ออกแบบฐานข้อมูลและผู้ใช้ฐานข้อมูล', NULL, 139);
INSERT INTO `it_keyword_meaning` VALUES (140, 'the process of organizing data in a database. This includes creating tables and establishing relationships between those tables according to rules designed both to protect the data and to make the database more flexible by eliminating redundancy and incon', 'วิธีการหนึ่งที่ช่วยลดความซ้ำซ้อนของข้อมูลจากฐานข้อมูล', NULL, 140);
INSERT INTO `it_keyword_meaning` VALUES (141, 'form of communication system in which data represent and are processed as a form of social memory.', 'เป็นระบบพื้นฐานของการทำงานต่างๆ ในรูปแบบของการเก็บ (input) การประมวลผล (processing) เผยแพร่ (output) และมีส่วนจัดเก็บข้อมูล (storage)', NULL, 141);
INSERT INTO `it_keyword_meaning` VALUES (142, 'the possibility, capability, or likelihood of something being done or accomplished', 'การศึกษาความเป็นไปได้ของโครงการต่างๆ ที่ธุรกิจมีแนวคิดที่จะทำหรือดำเนินการเพื่อใช้เป็นแนวทางในการขับเคลื่อนธุรกิจให้ประสบความสำเร็จ', NULL, 142);
INSERT INTO `it_keyword_meaning` VALUES (143, 'an organized collection of structured information, or data, typically stored electronically in a computer system.', 'การจัดระเบียบของข้อมูลที่มีโครงสร้างหรือข้อมูล ซึ่งโดยทั่วไปแล้วจะจัดเก็บทางอิเล็กทรอนิกส์ในระบบคอมพิวเตอร์', NULL, 143);
INSERT INTO `it_keyword_meaning` VALUES (144, ' a broad term for any system, either physical or software based, that allows a user to connect with a given technology. Many different kinds of user interfaces come with various devices and software programs. Many of them have some basic similarities, alt', 'ซอฟต์แวร์ที่อนุญาตให้ผู้ใช้เชื่อมต่อกับเทคโนโลยีที่กำหนด อินเทอร์เฟซผู้ใช้หลายประเภทมาพร้อมกับอุปกรณ์และโปรแกรมซอฟต์แวร์ที่หลากหลาย', NULL, 144);
INSERT INTO `it_keyword_meaning` VALUES (145, 'a high-level computer programming language that implements objects and their associated procedures within the programming context to create software programs.', 'เป็นภาษาการเขียนโปรแกรมคอมพิวเตอร์ระดับสูงที่ใช้วัตถุและขั้นตอนที่เกี่ยวข้องภายในบริบทการเขียนโปรแกรมเพื่อสร้างโปรแกรมซอฟต์แวร์', NULL, 145);
INSERT INTO `it_keyword_meaning` VALUES (146, 'one that uses technology as an advantage in its internal and external operations', 'คือการเปลี่ยนแปลงธุรกิจที่มีอยู่แบบเดิมให้เป็นธุรกิจแบบที่มีการใช้เทคโนโลยีเข้ามาช่วยปรับเปลี่ยนโครงสร้าง', NULL, 146);
INSERT INTO `it_keyword_meaning` VALUES (147, 'ype of software that organizations use to manage day-to-day business activities such as accounting, procurement, project management, risk management and compliance, and supply chain operations.', 'ระบบงานที่ควบคุมการบริหารทรัพยาการภายในบริษัท ของการผสมผสานมีการเชื่อมโยงกระบวนการของธุรกิจอย่างเป็นระบบ ระบบจัดซื้อ การวางแผนการผลิต ระบบต้นทุน ระบบบัญชี การจัดการสินค้าคงคลัง การกระจายสินค้า การจัดการสินทรัพย์ การบริหารบุคคล', NULL, 147);
INSERT INTO `it_keyword_meaning` VALUES (148, 'the management of the flow of goods and services and includes all processes that transform raw materials into final products. It involves the active streamlining of a business\'s supply-side activities to maximize customer value and gain a competitive adva', 'การจัดการในส่วนของกระบวนการที่เกิดขึ้น ระหว่างผู้ผลิต (ผู้ให้บริการ) กับผู้ขายปัจจัยผลิต (ซัพพลายเออร์) เพื่อช่วยลดต้นทุนในการผลิต อันนำไปสู่การเพิ่มผลกำไรของกิจการได้ในที่สุด', NULL, 148);
INSERT INTO `it_keyword_meaning` VALUES (149, 'technology for managing all your company\'s relationships and interactions with customers and potential customers', 'ใช้เทคโนโลยีและการใช้บุคลากรอย่างมีหลักการ เพื่อเพิ่มระดับการให้บริการแก่ลูกค้า สร้างความเข้าใจในความต้องการของลูกค้า รวมทั้งตอบสนองต่อความต้องการของลูกค้าทั้งในด้านผลิตภัณฑ์ และ การบริการ', NULL, 149);
INSERT INTO `it_keyword_meaning` VALUES (150, 'is the task of uniting the databases and workflows associated with business applications to ensure that the business uses the information consistently and that changes to core business data made by one application are correctly reflected in others.', 'framework ของ software ที่จะทำหน้าที่เป็นตัวกลาง หรือ Middleware เพื่อเชื่อมการทำงานต่างๆ เพื่อให้สามารถทำงานร่วมกันได้อย่างมีประสิทธิภาพ เช่น การใช้ข้อมูลร่วมกัน , การติดต่อสื่อสารระหว่างระบบ', NULL, 150);
INSERT INTO `it_keyword_meaning` VALUES (151, 'a study of an individual unit, as a person, family, or social group, usually emphasizing developmental issues and relationships with the environment, especially in order to compare a larger group to the individual unit.', 'ศึกษาหน่วย บุคคล ครอบครัว หรือกลุ่มสังคม มักจะเน้นปัญหาการพัฒนาและความสัมพันธ์กับสิ่งแวดล้อม โดยเฉพาะอย่างยิ่งเพื่อเปรียบเทียบกลุ่มใหญ่กับแต่ละหน่วย', NULL, 151);
INSERT INTO `it_keyword_meaning` VALUES (152, 'is the promotion of brands to connect with potential customers using the internet and other forms of digital communication.', 'เป็นรูปแบบหนึ่งของการตลาดสินค้าหรือบริการที่ใช้เทคโนโลยีด้านดิจิทัลทางอินเทอร์เน็ต ทั้งแอปพลิเคชันโทรศัพท์มือถือ การโฆษณาด้วยการแสดงข้อความจอภาพ และสื่อดิจิทัลอื่น ๆ', NULL, 152);
INSERT INTO `it_keyword_meaning` VALUES (153, 'Volume of demand for goods and services', 'ปริมาณความต้องการซื้อสินค้าและบริการ', NULL, 153);
INSERT INTO `it_keyword_meaning` VALUES (154, 'Volume of supply for goods and services', 'ปริมาณความต้องการเสนอขายสินค้าและบริการ', NULL, 154);
INSERT INTO `it_keyword_meaning` VALUES (155, 'Programming logic is a fundamental construct that\'s applied to computer science in a variety of comprehensive ways.Programming logic involves logical operations on hard data that works according to logical principles and quantifiable results.', 'การเขียนโปรแกรมเป็นโครงสร้างพื้นฐานที่ใช้กับวิทยาการคอมพิวเตอร์ในรูปแบบต่างๆ ที่ครอบคลุมตรรกะของการเขียนโปรแกรมเกี่ยวข้องกับการดำเนินการเชิงตรรกะกับข้อมูลที่ยากซึ่งทำงานตามหลักการทางตรรกะและผลลัพธ์เชิงปริมาณ', 'techopedia.com', 155);
INSERT INTO `it_keyword_meaning` VALUES (156, 'the category of algebra in which the variable\'s values are the truth values, true and false, ordinarily denoted 1 and 0 respectively.', 'สมการที่แสดง ความสัมพันธ์ของค่าคงที่และตัวแปร แต่ค่าคงที่ของพีชคณิต บูลีน คือค่าในเลขฐาน 2 (1 และ 0 เท่านั้น) ', NULL, 156);
INSERT INTO `it_keyword_meaning` VALUES (157, 'tool or device that has limited memory (using a limited state to remember) and receives information by reading the input bar. This device answers whether the strings in the log bar are acceptable or not', 'เครื่องมือหรืออุปกรณ์คำนวณชนิดหนึ่งซึ่งมีหน่วยความจำจำกัด (ใช้สถานะจำกัดในการจดจำ) และรับข้อมูลโดยการอ่านแถบบันทึกรับเข้า โดยที่อุปกรณ์ชนิดนี้จะให้คำตอบว่าสายอักขระที่อยู่ในแถบบันทึกรับเข้านั้นยอมรับได้หรือไม่ได้', NULL, 157);
INSERT INTO `it_keyword_meaning` VALUES (158, 'Data visualization software provides the conversion of textual and numeric data into visual charts, figures and tables.', 'เทคโนโลยีจำลองคอมพิวเตอร์เสมือน', NULL, 158);
INSERT INTO `it_keyword_meaning` VALUES (159, 'combines business analytics, data mining, data visualization, data tools and infrastructure, and best practices to help organizations make more data-driven decisions.', 'เทคโนโลยีที่มีความสามารถในการแปลงข้อมูลปกติให้เป็นข้อมูลเชิงลึกที่สามารถนำไปช่วยในการติดสินใจ วิเคราะห์ผล หรือเฝ้าติดตามต่างๆ และเพื่อช่วยให้ธุรกิจตัดสินใจได้อย่างชาญฉลาดยิ่งขึ้นผ่านการขับเคลื่อนด้วยข้อมูล', NULL, 159);
INSERT INTO `it_keyword_meaning` VALUES (160, 'data that contains greater variety, arriving in increasing volumes and with more velocity.', 'ข้อมูลที่มีปริมาณมาก ๆ มาผ่านการประมวลผล การวิเคราะห์ และแสดงผล ด้วยวิธีที่เหมาะสม', NULL, 160);
INSERT INTO `it_keyword_meaning` VALUES (161, 'a set of documents that show the ficial situation of a company at the end of a particular period of time, including how much profit or loss it has made', 'รายงานที่จัดทำตามรอบระยะเวลาบัญชี', NULL, 161);
INSERT INTO `it_keyword_meaning` VALUES (162, 'often used by technology journalists and others to describe technologies as diverse as cryptocurrency tools, ficial transaction platforms and industry-specific middleware programs.', 'การนำเอาการเงิน (Ficial) มาบวกเข้ากับเทคโนโลยี (Technology) เพื่อสร้างนวัตกรรมใหม่ด้านการเงิน เพื่อเป็นสินค้า บริการ การแก้ปัญหาทางการเงิน รวมถึงเป็นแนวทางในการประกอบธุรกิจใหม่ ๆ ทำให้การจัดการ และการเข้าถึงทางการเงินเป็นไปได้ง่ายขึ้น ด้วยเทคโนโลยี', NULL, 162);
INSERT INTO `it_keyword_meaning` VALUES (163, 'a way of scrambling data so that only authorized parties can understand the information. In technical terms, it is the process of converting human-readable plaintext to incomprehensible text, also known as ciphertext.', 'กระบวนการสำหรับการแปรรูปข้อมูลเล็กทรอนิกส์ธรรมดาให้อยู่ในรูปที่บุคคลทั่วไปไม่สามารถอ่านเข้าใจได้', NULL, 163);
INSERT INTO `it_keyword_meaning` VALUES (164, 'distributed database or ledger that is shared among the nodes of a computer network. As a database, a blockchain stores information electronically in digital format', 'ระบบโครงข่ายในการเก็บบัญชีธุรกรรมออนไลน์ ซึ่งมีลักษณะเป็นเครือข่ายใยแมงมุมที่เก็บสถิติการทำธุรกรรมทางการเงินและสินทรัพย์ชนิดอื่นๆในอนาคต โดยไม่มีตัวกลางคือสถาบันการเงินหรือสำนักชำระบัญชี', NULL, 164);
INSERT INTO `it_keyword_meaning` VALUES (165, 'a class of digital assets created using cryptographic techniques that enable people to buy, sell or trade them securely. Unlike traditional fiat currencies controlled by national governments, cryptocurrencies can circulate without a monetary authority suc', 'เป็นสินทรัพย์ดิจิทัลซึ่งออกแบบให้เป็นสื่อกลางการแลกเปลี่ยน ที่ใช้วิทยการเข้ารหัสลับเพื่อรับประกันธุรกรรม เพื่อควบคุมการสร้างหน่วยเงินเพิ่ม และเพื่อยืนยันความถูกต้องของการโอนทรัพย์', NULL, 165);
INSERT INTO `it_keyword_meaning` VALUES (166, 'a subfield of artificial intelligence, which is broadly defined as the capability of a machine to imitate intelligent human behavior.', 'ระบบที่สามารถเรียนรู้ได้จากตัวอย่างด้วยตนเองโดยปราศจากการป้อนคำสั่งของโปรแกรมเมอร์', NULL, 166);
INSERT INTO `it_keyword_meaning` VALUES (167, 'a set of rules for formatting and processing data.', 'ชุดของกฎสำหรับการจัดรูปแบบและการประมวลผลข้อมูล', NULL, 167);
INSERT INTO `it_keyword_meaning` VALUES (168, 'the study of how people working for large companies or organizations think and behave, and the effect that this has on the company or organization that they work for', 'การแสดงออกหรือแนวโน้มของปฏิกิริยาที่จะแสดงออกของบุคคลในสภาพการณ์', NULL, 168);
INSERT INTO `it_keyword_meaning` VALUES (169, 'someone who starts their own business, especially when this involves seeing a new opportunity', 'กระบวนการในการออกแบบธุรกิจ เปิดตัวสินค้าหรือบริการของธุรกิจสู่สาธารณะ และ การประกอบธุรกิจใหม่ ซึ่งมักจะเริ่มต้นด้วยการเป็นธุรกิจขนาดเล็ก', NULL, 169);
INSERT INTO `it_keyword_meaning` VALUES (170, 'a broad term for any system, either physical or software based, that allows a user to connect with a given technology.', 'การออกแบบจอภาพออกแบบจอภาพเพื่่อให้ผู้ใช้งานสามารถโต้ตอบกับระบบได้ตามต้องการอย่างมีประสิทธิภาพ ซึ่งปัจจุบันนิยมการออกแบบส่วนติดต่อกับผู้ใช้งานแบบกราฟิก', NULL, 170);
INSERT INTO `it_keyword_meaning` VALUES (171, 'User experience (UX) is a concept in computing system and application design that studies and evaluates human feelings and expressions when using such systems.', ' ประสบการณ์ของผู้ใช้งานในด้านความรู้สึกที่ตอบสนองต่อการใช้งานผลิตภัณฑ์ หรือระบบต่าง ๆ', NULL, 171);
INSERT INTO `it_keyword_meaning` VALUES (172, 'key changes in the strategic direction of the digital marketing landscape', 'การเปลี่ยนแปลงที่สำคัญในทิศทางเชิงกลยุทธ์ของภูมิทัศน์การตลาดดิจิทัล', NULL, 172);
INSERT INTO `it_keyword_meaning` VALUES (173, 'systematic and objective inquiry that provides information to guide managerial decisions, which are arrived at through a process of planning, acquiring, analyzing, and disseminating relevant data to decision-makers in ways that mobilize the organization t', 'การศึกษาค้นคว้าเพื่อให้ได้มาซึ่งความรู้ทางธุรกิจในด้านต่าง ๆ ', NULL, 173);
INSERT INTO `it_keyword_meaning` VALUES (174, 'the process of verifying whether a product meets required specifications and customer expectations.', 'เป็นวิธีบริหารจัดการเพื่อเป็นหลักประกันหรือสร้างความมั่นใจว่ากระบวนการหรือการดำเนินงานจะทำให้ได้ผลลัพธ์ที่มีคุณภาพตรงตามที่กำหนด', NULL, 174);
INSERT INTO `it_keyword_meaning` VALUES (175, 'the exposure a company or organization has to factor(s) that will lower its profits or lead it to fail', 'เป็นความเสี่ยงที่เกิดขึ้นจากอุปกรณ์คอมพิวเตอร์เช่น การถูก hack ข้อมูต่างๆ หรือไวรัสประเภทต่างๆที่มาทำลายระบบการทำงานของคอมพิวเตอร์ซึ่งวิธีการจัดการด้านความเสี่ยงนี้จะเน้นไปที่เรื่องของความปลอดภัย', NULL, 175);
INSERT INTO `it_keyword_meaning` VALUES (176, 'the act of overseeing all activities and tasks that must be accomplished to maintain a desired level of excellence.', 'กระบวนการในการบ่งชี้และบริหารกิจกรรมต่าง ๆ ที่มีความจำเป็นอย่างยิ่งต่อการดำเนินการ เพื่อให้สามารถบรรลุวัตถุประสงค์ด้านคุณภาพขององค์กร', NULL, 176);
INSERT INTO `it_keyword_meaning` VALUES (177, 'someone\'s idea, invention, creation, etc., that can be protected by law from being copied by someone else', 'ความคิด ไอเดีย ที่เกิดจากสติปัญญา คิด สร้างสรรค์ขึ้นจนเกิดเป็นผลงาน ผลผลิต ที่สามารถสร้างคุณค่าให้เกิดขึ้นได้ หรือสามารถนำไปต่อยอดเป็นผลผลิต สินค้า ผลิตภัณฑ์ ที่มีคุณค่า โดยเริ่มต้นจากความคิด และปัญญา สิ่งนั้นเรียกว่า', NULL, 177);
INSERT INTO `it_keyword_meaning` VALUES (178, 'one that uses technology as an advantage in its internal and external operations.', 'เป็นการนำเอาเทคโนโลยีต่างๆ เข้ามาพัฒนาเพื่อเพิ่มความสะดวกสบายให้ทั้งผู้ประกอบการและผู้บริโภคในการเลือกซื้อสินค้า หรือบริการต่างๆ ', NULL, 178);
INSERT INTO `it_keyword_meaning` VALUES (179, 'one that uses technology as an advantage in its internal and external operations.', 'เป็นการนำเอาเทคโนโลยีต่างๆ เข้ามาพัฒนาเพื่อเพิ่มความสะดวกสบายให้ทั้งผู้ประกอบการและผู้บริโภคในการเลือกซื้อสินค้า หรือบริการต่างๆ ', NULL, 179);
INSERT INTO `it_keyword_meaning` VALUES (180, 'an occasion when a teacher or expert and a group of people meet to study and discuss something', 'รูปแบบหนึ่งของการเรียนการสอนในระดับอุดมศึกษาหรือบริษัทต่าง ๆ โดยแบ่งกลุ่มผู้เรียนเป็นกลุ่มเล็กเพื่ออภิปรายเรื่องราวเฉพาะตอนใดตอนหนึ่งของบทเรียนด้วยบทบาทที่สูง', NULL, 180);
INSERT INTO `it_keyword_meaning` VALUES (181, 'an occasion when a teacher or expert and a group of people meet to study and discuss something', 'รูปแบบหนึ่งของการเรียนการสอนในระดับอุดมศึกษาหรือบริษัทต่าง ๆ โดยแบ่งกลุ่มผู้เรียนเป็นกลุ่มเล็กเพื่ออภิปรายเรื่องราวเฉพาะตอนใดตอนหนึ่งของบทเรียนด้วยบทบาทที่สูง', NULL, 181);
INSERT INTO `it_keyword_meaning` VALUES (182, 'a college-held program that allows a student to take their classroom knowledge and apply it to an on-site job.', ' เป็นระบบการศึกษาที่เน้นการปฏิบัติงานจริงในสถาน ประกอบการ ', NULL, 182);
INSERT INTO `it_keyword_meaning` VALUES (183, 'a college-held program that allows a student to take their classroom knowledge and apply it to an on-site job.', ' เป็นระบบการศึกษาที่เน้นการปฏิบัติงานจริงในสถาน ประกอบการ ', NULL, 183);
INSERT INTO `it_keyword_meaning` VALUES (184, 'the system of rules and acceptable behaviour used at official ceremonies and occasions', 'ชุดกฎพื้นฐานที่อนุญาตให้ใช้ข้อมูลร่วมกันระหว่างคอมพิวเตอร์ได้ สำหรับสกุลเงินดิจิทัล ชุดกฎเหล่านั้นคือตัวกำหนดโครงสร้างของบล็อกเชน ซึ่งเป็นฐานข้อมูลแบบกระจายที่ช่วยให้แลกเปลี่ยนเงินดิจิทัลบนอินเทอร์เน็ตได้อย่างปลอดภัย', NULL, 184);
INSERT INTO `it_keyword_meaning` VALUES (185, 'servers that are accessed over the Internet, and the software and databases that run on those servers. Cloud servers are located in data centers all over the world. By using cloud computing, users and companies do not have to manage physical servers thems', 'เป็นลักษณะของการทำงานของผู้ใช้งานคอมพิวเตอร์ผ่านอินเทอร์เน็ต ที่ให้บริการใดบริการหนึ่งกับผู้ใช้ โดยผู้ให้บริการจะแบ่งปันทรัพยากรให้กับผู้ต้องการใช้งานนั้น การประมวลผลแบบกลุ่มเมฆ เป็นลักษณะที่พัฒนาขึ้นต่อมาจากความคิดและบริการของเวอร์ชัวไลเซชันและเว็บเซอร์ว', NULL, 185);
INSERT INTO `it_keyword_meaning` VALUES (186, 'refers to methods used to increase traffic to a website by increasing its search engine page rank.', 'โปรแกรมที่ช่วยในการสืบค้นหาข้อมูล โดยเฉพาะข้อมูลบนอินเทอร์เน็ต โดยครอบคลุมทั้งข้อความ รูปภาพ ภาพเคลื่อนไหว เพลง ซอฟต์แวร์ แผนที่ ข้อมูลบุคคล กลุ่มข่าว และอื่น ๆ ซึ่งแตกต่างกันไปแล้วแต่โปรแกรมหรือผู้ให้บริการแต่ละราย.', NULL, 186);
INSERT INTO `it_keyword_meaning` VALUES (187, 'refers to a collection of multiple pieces of equipment involved in the collection, processing, storage, and dissemination of information.', 'เป็นระบบพื้นฐานของการทำงานต่างๆ ในรูปแบบของการเก็บ (input) การประมวลผล (processing) เผยแพร่ (output) และมีส่วนจัดเก็บข้อมูล (storage)', NULL, 187);
INSERT INTO `it_keyword_meaning` VALUES (188, 'a quantitative analytical approach that focuses on helping organizational management to solve problems and make better decisions.', 'เป็นกระบวนการที่ใช้เทคนิคทางคณิตศาสตร์ ทฤษฎีความน่าจะเป็นและสถิติ ทฤษฎีโครงข่าย และการจำลองแบบระบบด้วยคอมพิวเตอร์ เพื่อช่วยในการตัดสินใจแก้ปัญหาด้านต่างๆ', NULL, 188);
INSERT INTO `it_keyword_meaning` VALUES (189, 'project management planning tool used to calculate the amount of time it will take to realistically finish a project.', 'เทคนิควิธีการวางแผนและการควบคุมแผนซึ่งมีความซับซ้อน โดยแสดงถึงข่ายของงาน ที่ประกอบด้วยเหตุการณ์ และกิจกรรม กับเวลาโดยประมาณ เพื่อคำนวณหาเวลาที่คาดหวังของกิจกรรมแต่ละกิจกรรมจะแล้วเสร็จ', NULL, 189);
INSERT INTO `it_keyword_meaning` VALUES (190, 'a technique that allows you to identify tasks that are necessary for project completion.', 'เทคนิคการสร้างแบบจำลองโครงการที่คุณสามารถใช้ในการวิเคราะห์ วางแผน และกำหนดเวลาโครงการที่ซับซ้อนได้', NULL, 190);
INSERT INTO `it_keyword_meaning` VALUES (191, 'the study of information and communication tools in cultural or institutional contexts.', 'เป็นการศึกษาเครื่องมือการสื่อสารและสารสนเทศในบริบทวัฒนธรรมและสถาบัน หรือการศึกษาแบบสหวิทยาการของการออกแบบ การใช้ และผลที่ตามมาจากเทคโนโลยีสารสนเทศ ซึ่งคำนึงถึงการปฏิสัมพันธ์ระหว่างเทคโนโลยีเหล่านั้นกับบริบททางสถาบันและทางวัฒนธรม ด้วยความเป็นสหวิทยาการของม', NULL, 191);
INSERT INTO `it_keyword_meaning` VALUES (192, 'a formal statement of the rules on which a subject of study is based or of ideas that are suggested to explain a fact or event or, more generally, an opinion or explanation', 'สมมติฐานที่ได้รับการตรวจสอบและทดลองหลายครั้งหลายหนจนสามารถอธิบายข้อเท็จจริงสามารถคาดคะเนทำนายเหตุการณ์ทั่วๆไป ที่เกี่ยวข้องกับปรากฏการณ์นั้นอย่างถูกต้อง และมีเหตุผลเป็นที่ยอมรับของคนทั่วไป จึงเป็นผลให้สมมติฐานกลายเป็นทฤษฎี', NULL, 192);
INSERT INTO `it_keyword_meaning` VALUES (193, 'a computer language engineered to create a standard form of commands. ', 'ภาษาประดิษฐ์ชนิดหนึ่งที่ออกแบบขึ้นมาเพื่อสื่อสารชุดคำสั่งแก่เครื่องจักร โดยเฉพาะอย่างยิ่งคอมพิวเตอร์ ภาษาโปรแกรมสามารถใช้สร้างโปรแกรมที่ควบคุมพฤติกรรมของเครื่องจักร และ/หรือ แสดงออกด้วยขั้นตอนวิธี (algorithm) อย่างตรงไปตรงมา ผู้เขียนโปรแกรมซึ่งหมายถึงผู้ท', NULL, 193);
INSERT INTO `it_keyword_meaning` VALUES (194, 'the use of computing technologies for the identification, discovery and analysis of business data - like sales revenue, products, costs and incomes.', ' เป็นเทคนิคที่ใช้คอมพิวเตอร์ในการวิเคราะห์ ดึงข้อมูลที่โดดเด่น', NULL, 194);
INSERT INTO `it_keyword_meaning` VALUES (195, 'a data integration process that combines data from multiple data sources into a single, consistent data store that is loaded into a data warehouse or other target system.', 'กระบวนการหนึ่งในระบบ Data Warehouse โดยระบบที่ออกแบบเอาไว้จะดึงข้อมูลออกมาจากหลายๆ ที่, นำกระบวนการตรวจสอบคุณภาพของข้อมูลมาประยุกต์ใช้, มีการเชื่อมโยงและปรับข้อมูลให้เป็นไปในรูปแบบเดียวกันเพื่อให้ ข้อมูลจากหลายๆ แหล่งสามารถใช้งานร่วมกันได้ และท้ายที่สุดทำ', NULL, 195);
INSERT INTO `it_keyword_meaning` VALUES (196, 'a technology that organizes large business databases and supports complex analysis.', 'เทคโนโลยีที่ใช้เพื่อจัดระเบียบฐานข้อมูลธุรกิจขนาดใหญ่และสนับสนุนการวิเคราะห์ข้อมูที่ซับซ้อน', NULL, 196);
INSERT INTO `it_keyword_meaning` VALUES (197, 'enables the real-time execution of large numbers of database transactions by large numbers of people, typically over the internet.', 'เป็นระบบที่อำนวยความสะดวกเพื่อความรวดเร็วในการให้บริการ โดยเมื่อมีการป้อนข้อมูลหน่วยประมวลผลกลางจะทำการประมวลผลในทันที', NULL, 197);
INSERT INTO `it_keyword_meaning` VALUES (198, 'ways that a company can encourage customers to like it and buy from it, for example by using software to look at information it has about its customers and by using social media', 'การบริหารความสัมพันธ์กับลูกค้า โดยมีเป้าหมายสูงสุดคือความพึงพอใจของลูกค้าหรือผู้ที่มีโอกาสเป็นลูกค้า ตั้งแต่การนำเสนอสินค้าหรือบริการ ไปจนถึงการทำให้เกิดการซื้อซ้ำๆ', NULL, 198);
INSERT INTO `it_keyword_meaning` VALUES (199, 'selected through a management framework. To identify and establish the critical KPIs, an enterprise process must be created to meet the following requirements', 'เป็นดัชนีชี้วัด หรือหน่วยวัดความสำเร็จของการปฏิบัติงานที่ถูกกำหนดขึ้น โดยเป็นหน่วยวัดที่ควรมีผลเป็นตัวเลขที่นับได้จริง และต้องสื่อถึงเป้าหมายในการปฏิบัติงานสำคัญ ทั้งนี้เพื่อสร้างความชัดเจนในการกำหนด ติดตามและประเมินผลการปฏิบัติงานในด้านต่างๆ', NULL, 199);
INSERT INTO `it_keyword_meaning` VALUES (200, 'Is the system improving processes across the value stream in order to eliminate waste and deliver optimized value to the customer.', 'เป็นระบบที่ช่วยลดความสูญเสีย เปลี่ยนความสูญเปล่าให้มีเกิดคุณค่า นำมาซึ่งการบริหารจัดการที่ประสบความสำเร็จ เกี่ยวข้องกับการผลิตโดยตรง ทำให้กระบวนการผลิตมีประสิทธิภาพมากขึ้น', NULL, 200);
INSERT INTO `it_keyword_meaning` VALUES (201, 'epresents the complete workflow from the demand (trigger) to delivery (return of investment) of a product or service at the right time.', 'เป็นเครื่องมือและเทคนิคที่สนับสนุนการพัฒนากลยุทธ์การผลิตแบบลีน ทำให้สามารถมองเห็นภาพรวม (Big Picture) ของกระบวนการ การเชื่อมโยงการไหลของข้อมูล และวัตถุดิบ ขั้นตอนการสร้างคุณค่า ค้าหาแหล่งกำเนิดของความสูญเปล่า (Source of Waste) และคอขวด (Bottle Neck)', NULL, 201);
INSERT INTO `it_keyword_meaning` VALUES (202, 'the process of identifying, assessing and controlling threats to an organization\'s capital and earnings. These risks stem from a variety of sources including financial uncertainties, legal liabilities, technology issues, strategic management errors, accid', 'กระบวนการดำเนินงานขององค์กรที่เป็นระบบและต่อเนื่อง เพื่อช่วยให้องค์กรลดมูลเหตุของแต่ละโอกาสที่จะเกิดความเสียหาย ให้ระดับของความเสียหายและขนาดของความเสียหายที่จะเกิดขึ้นในอนาคต อยู่ในระดับที่องค์กรยอมรับได้ ประเมินได้ ควบคุมได้ และตรวจสอบได้อย่างมีระบบ โดย', NULL, 202);
INSERT INTO `it_keyword_meaning` VALUES (203, '(the study and knowledge of) the practical, especially industrial, use of scientific discoveries', 'กิจกรรมที่เกี่ยวข้องกับเครื่องจักรกล สิ่งประดิษฐ์ใหม่ ๆ ทางอุตสาหกรรม', NULL, 203);
INSERT INTO `it_keyword_meaning` VALUES (204, 'Loan information about book, CD etc. that are borrowed by users of library.', 'เป็นวิธีการในที่จะควบคุมการส่งข้อมูลจากผู้ส่งไปยังผู้รับ เพื่อไม่ให้ข้อมูลถูกส่งออกไปมากเกินกว่าที่ผู้รับข้อมูลจะสามารถรับได้', NULL, 204);
INSERT INTO `it_keyword_meaning` VALUES (205, 'the field concerned with all aspects of managing and processing information, especially within a large organization or company.', 'การประยุกต์ใช้คอมพิวเตอร์และอุปกรณ์โทรคมนาคม เพื่อจัดเก็บ ค้นหา ส่งผ่าน และจัดดำเนินการข้อมูล', NULL, 205);
INSERT INTO `it_keyword_meaning` VALUES (206, 'a centralized repository that’s used to organize, store and share organizational knowledge with employees and customers.', 'เครื่องมือที่ใช้ในการบรรลุเป้าหมายอย่างน้อย 4 ประการไปพร้อมๆ กัน', NULL, 206);
INSERT INTO `it_keyword_meaning` VALUES (207, 'one that uses technology as an advantage in its internal and external operations.', 'การนำเอาเทคโนโลยีต่างๆ เข้ามาพัฒนาเพื่อเพิ่มความสะดวกสบายให้ทั้งผู้ประกอบการและผู้บริโภคในการเลือกซื้อสินค้า หรือบริการต่างๆ', NULL, 207);
