INSERT INTO `it_keyword_meaning` VALUES (214, 'a period of training spent in a hospital by a young doctor in order to finish their medical qualification', 'ประสบการณ์การทำงานระยะสั้นที่นำเสนอโดย บริษัท และองค์กรอื่น ๆ ', NULL, 214);
INSERT INTO `it_keyword_meaning` VALUES (215, 'allows professionals to engage in a number of areas such as analyzing and designing anything from simple microprocessors to highly featured circuits, software design, and operating system development.', 'เป็นศาสตร์ที่เกี่ยวข้องกับการออกแบบและสร้างเครื่องหรือระบบคอมพิวเตอร์ และ ระบบที่ใช้คอมพิวเตอร์ ศาสตร์นี้เกี่ยวข้องกับการศึกษาทางด้านฮาร์ดแวร์ ซอฟต์แวร์ การสื่อสาร ', 'Case Study: Definition, Examples, Types, and How to Write (verywellmind.com)', 215);
INSERT INTO `it_keyword_meaning` VALUES (216, 'a detailed account giving information about the development of a person, group, or thing, especially in order to show general principles', 'สำรวจความเป็นจริงเพื่อกำหนดทฤษฎีในภายหลัง. - อธิบายสิ่งที่เกิดขึ้นในกรณี.', 'CASE STUDY | meaning, definition in Cambridge English Dictionary', 216);
INSERT INTO `it_keyword_meaning` VALUES (217, 'a detailed account giving information about the development of a person, group, or thing, especially in order to show general principles', 'สำรวจความเป็นจริงเพื่อกำหนดทฤษฎีในภายหลัง. - อธิบายสิ่งที่เกิดขึ้นในกรณี.', 'CASE STUDY | meaning, definition in Cambridge English Dictionary', 217);
INSERT INTO `it_keyword_meaning` VALUES (218, 'a computer that operates on and/or incorporates aspects of quantum theory.', 'เทคโนโลยีที่หน่วยประมวลผลของคอมพิวเตอร์คิดได้เร็วขึ้นเป็นทวีคูณ', 'What is a Quantum Computer? - Definition from Techopedia', 218);
INSERT INTO `it_keyword_meaning` VALUES (219, ' the process of performing a particular computation (or more generally, accomplishing a specific computing result), usually by designing and building an executable computer program.', 'ชุดคำสั่งที่จะทำงานเมื่อยามคอมพิวเตอร์สั่งการ ', 'Computer programming - Wikipedia', 219);
INSERT INTO `it_keyword_meaning` VALUES (220, 'Orthogonal, in a computing context, describes a situation where a programming language or data object can be used without considering its after-effects toward other program functions.', 'คุณสมบัติที่หมายถึง \"การเปลี่ยน A ไม่เปลี่ยน B\" ตัวอย่างของระบบมุมฉากจะเป็นวิทยุซึ่งการเปลี่ยนสถานีจะไม่เปลี่ยนระดับเสียงและในทางกลับกัน', 'What is Orthogonal? - Definition from Techopedia', 220);
INSERT INTO `it_keyword_meaning` VALUES (221, 'an area of advanced mathematics in which continuously changing values are studied', 'ลิมิตและความต่อเนื่อง อนุพันธ์ของฟังก์ชันและการประยุกต์ ค่าเชิงอนุพันธ์และการประยุกต์ ปริพันธ์และการประยุกต์', 'CALCULUS | meaning, definition in Cambridge English Dictionary', 221);
INSERT INTO `it_keyword_meaning` VALUES (222, ' The methodology employed by the analyst depends on the nature of the data used and the reason for the analysis.', 'เป็นการอ้างอิงข้อมูลทางสถิติอย่างหนึ่งที่เกี่ยวกับค่าพารามิเตอร์ของประชากร', 'Hypothesis Testing Definition (investopedia.com)', 222);
INSERT INTO `it_keyword_meaning` VALUES (223, 'an in-depth study of one person, group, or event. In a case study, nearly every aspect of the subject\'s life and history is analyzed to seek patterns and causes of behavior.', 'เทคนิคในการสอน โดยมีพื้นฐานอยู่ที่การเลือกเหตุการณ์จากสถานการณ์ที่เป็นจริง เพื่อที่จะคิดหาทางแก้ไขที่เป็นไปได้ต่อไป', 'Case Study: Definition, Examples, Types, and How to Write (verywellmind.com)', 223);
INSERT INTO `it_keyword_meaning` VALUES (224, 'the things a company does to make sure that its products and services are as good as they should be', 'เป็นวิธีบริหารจัดการเพื่อเป็นหลักประกันหรือสร้างความมั่นใจว่ากระบวนการหรือการดำเนินงานจะทำให้ได้ผลลัพธ์ที่มีคุณภาพตรงตามที่กำหนด', 'QUALITY ASSURANCE | meaning, definition in Cambridge English Dictionary', 224);
INSERT INTO `it_keyword_meaning` VALUES (225, 'the art of creating, capturing and integrating data using a digital skillset.', 'เป็นการประยุกต์ใช้เทคโนโลยีขั้นสูงเพื่อเก็บข้อมูลและการออกแบบงานฝีมือในสภาพแวดล้อมดิจิทัล', 'What is digital engineering? | Aurecon (aurecongroup.com)', 225);
INSERT INTO `it_keyword_meaning` VALUES (226, 'a structured method of combining classroom-based education with practical work experience.', 'การศึกษาที่เน้นการปฏิบัติงานในหน่วยงาน ซึ่งเรียกว่า สถานประกอบการหรือองค์กรผู้ใช้บัณฑิต อย่างเป็นระบบก่อนสำเร็จการศึกษา', 'Cooperative education - Wikipedia', 226);
INSERT INTO `it_keyword_meaning` VALUES (227, 'the art of creating, capturing and integrating data using a digital skillset.', 'เป็นการประยุกต์ใช้เทคโนโลยีขั้นสูงเพื่อเก็บข้อมูลและการออกแบบงานฝีมือในสภาพแวดล้อมดิจิทัล', 'What is digital engineering? | Aurecon (aurecongroup.com)', 227);
INSERT INTO `it_keyword_meaning` VALUES (228, 'refers to the writing, markup and coding involved in Web development, which includes Web content, Web client and server scripting and network security. The most common languages used for Web programming are XML, HTML, JavaScript, Perl 5 and PHP.', 'การเขียนโปรแกรมบนเว็บไซต์ โดยใช้การพัฒนาแอพลิเคชั่นแบบ Web', 'What is Web Programming? - Definition from Techopedia', 228);
INSERT INTO `it_keyword_meaning` VALUES (229, 'conceptual structure intended to serve as a support or guide for the building of something that expands the structure into something useful.', 'เป็นเครื่องมือที่เป็นประโยชน์สำหรับโปรแกรมเมอร์และนักพัฒนาเพื่อใช้ในการสร้างเว็บไซต์และแอพพลิเคชันอื่นๆ', NULL, 229);
INSERT INTO `it_keyword_meaning` VALUES (230, 'invented by GM Adelson - Velsky and EM Landis in 1962. The tree is named AVL in honour of its inventors.', 'ความสูงสมดุลต้นไม้ค้นหาไบนารี', 'AVL Tree - javatpoint', 230);
INSERT INTO `it_keyword_meaning` VALUES (231, 'a procedure used for solving a problem or performing a computation.', 'ขั้นตอนหรือลำดับการประมวลผลในการแก้ปัญหาใดปัญหาหนึ่ง', NULL, 231);
INSERT INTO `it_keyword_meaning` VALUES (232, 'a database in which many connections are made between the tables in the database', 'ฐานข้อมูลที่จัดเก็บข้อมูลในรูปแบบของตารางประกอบด้วย ข้อมูลแถวแนวนอน (Rows) และแถวแนวตั้ง (Columns) และแต่ละตารางในฐานข้อมูลจะมีการเก็บข้อมูลที่มีความสัมพันธ์กัน', 'RELATIONAL DATABASE | meaning, definition in Cambridge English Dictionary', 232);
INSERT INTO `it_keyword_meaning` VALUES (233, 'Programming logic is a fundamental construct that\'s applied to computer science in a variety of comprehensive ways.Programming logic involves logical operations on hard data that works according to logical principles and quantifiable results.', 'การเขียนโปรแกรมเป็นโครงสร้างพื้นฐานที่ใช้กับวิทยาการคอมพิวเตอร์ในรูปแบบต่างๆ ที่ครอบคลุมตรรกะของการเขียนโปรแกรมเกี่ยวข้องกับการดำเนินการเชิงตรรกะกับข้อมูลที่ยากซึ่งทำงานตามหลักการทางตรรกะและผลลัพธ์เชิงปริมาณ', 'techopedia.com', 233);
INSERT INTO `it_keyword_meaning` VALUES (234, 'a machine that performs a function according to a predetermined set of coded instructions, especially one capable of a range of programmed responses to different circumstances.', 'เครื่องมือหรืออุปกรณ์คำนวณชนิดหนึ่งซึ่งมีหน่วยความจำจำกัด (ใช้สถานะจำกัดในการจดจำ) และรับข้อมูลโดยการอ่านแถบบันทึกรับเข้า โดยที่อุปกรณ์ชนิดนี้จะให้คำตอบว่าสายอักขระที่อยู่ในแถบบันทึกรับเข้านั้นยอมรับได้หรือไม่ได้ ', NULL, 234);
INSERT INTO `it_keyword_meaning` VALUES (235, 'used to describe a method of searching on a computer using terms such as \'and\', \'not\', and \'or\', which are known as Boolean operators', 'ค่า\"จริง\" (True) หรือ \"ไม่จริง \" (False) ใช้มากในการเขียนโปรแกรม เป็นหลัก พิชคณิต ที่ตั้งตามชื่อของผู้คิด คือ ยอร์ช บูล (George Boole) หลักทั่วไปคล้ายพิชคณิต ธรรมดา แต่ใช้ระบบเลขฐานสอง', 'Boolean | meaning, definition in Cambridge English Dictionary', 235);
INSERT INTO `it_keyword_meaning` VALUES (236, 'a set of protocols, routines, functions and/or commands that programmers use to facilitate interaction between distinct software services.', 'ระบบบริการข้อมูลกลางระหว่าง client', 'What is an Application Programming Interface (API)? - Definition from Techopedia', 236);
INSERT INTO `it_keyword_meaning` VALUES (237, 'a person who applies the principles of software engineering to design, develop, maintain, test, and evaluate computer software. The term programmer is sometimes used as a synonym, but may also lack connotations of engineering education or skills.', 'เป็นศาสตร์เกี่ยวกับวิศวกรรมด้านซอฟต์แวร์ มีเนื้อหาเกี่ยวข้องกับการใช้กระบวนการทางวิศวกรรมในการดูแลการผลิต ตั้งแต่การเริ่มเก็บความต้องการ การตั้งเป้าหมายของระบบ การออกแบบ กระบวนการพัฒนา การตรวจสอบ การประเมินผล การติดตามโครงการ การประเมินต้นทุน การรักษาความ', 'Software engineering - Wikipedia', 237);
INSERT INTO `it_keyword_meaning` VALUES (238, 'the language a computer uses to access the internet.', 'โปรโตคอลมาตรฐานที่ใช้งาน บนเครือข่ายอินเทอร์เน็ต', 'What is TCP/IP? - Definition from Techopedia', 238);
INSERT INTO `it_keyword_meaning` VALUES (239, 'a conceptual model created by the International Organization for Standardization which enables diverse communication systems to communicate using standard protocols.', 'เป็นรูปแบบความคิดที่พรรณนาถึงคุณสมบัติพิเศษและมาตรฐานการทำงานภายในของระบบการสื่อสารโดยแบ่งเป็นชั้นนามธรรม และโพรโทคอลของระบบคอมพิวเตอร์ พัฒนาขึ้นโดยองค์การระหว่างประเทศว่าด้วยการมาตรฐาน (ISO)', NULL, 239);
INSERT INTO `it_keyword_meaning` VALUES (240, 'a study of an individual unit, as a person, family, or social group, usually emphasizing developmental issues and relationships with the environment, especially in order to compare a larger group to the individual unit.', 'เทคนิคในการสอน โดยมีพื้นฐานอยู่ที่การเลือกเหตุการณ์จากสถานการณ์ที่เป็นจริง เพื่อที่จะคิดหาทางแก้ไขที่เป็นไปได้ต่อไป', NULL, 240);
INSERT INTO `it_keyword_meaning` VALUES (241, 'the practice of creating and understanding codes that keep information secret', ' วิชาเกี่ยวกับการเข้ารหัสลับคือการแปลงข้อความปกติให้กลายเป็นข้อความลับ โดยข้อความลับคือข้อความที่ผู้อื่น นอกเหนือจากคู่สนทนาที่ต้องการ ไม่สามารถเข้าใจได้', 'CRYPTOGRAPHY | meaning, definition in Cambridge English Dictionary', 241);
INSERT INTO `it_keyword_meaning` VALUES (242, ' a symmetric key is one that is used both to encrypt and decrypt information.', 'เป็นระบบรหัสที่ใช้กุญแจชุดเดียวกันทั้งผู้ส่งและผู้รับในการเข้าและถอดรหัสลับ', NULL, 242);
INSERT INTO `it_keyword_meaning` VALUES (243, 'is the practice of concealing a message within another message or a physical object.', 'เป็นวิทยาการว่าด้วยการซ่อนข้อมูลภายในข้อมูลอื่น ๆ หรือซ่อนภายในวัตถุ (ทางกายภาพ)', NULL, 243);
INSERT INTO `it_keyword_meaning` VALUES (244, 'a detailed account giving information about the development of a person, group, or thing, especially in order to show general principles', 'สำรวจความเป็นจริงเพื่อกำหนดทฤษฎีในภายหลัง. - อธิบายสิ่งที่เกิดขึ้นในกรณี.', 'CASE STUDY | meaning, definition in Cambridge English Dictionary', 244);
INSERT INTO `it_keyword_meaning` VALUES (245, 'a path through which electric current flows.', 'เส้นทางที่กระแสไฟฟ้าไหลจากแหล่งกำเนิดไฟฟ้าผ่านตัวนำไฟฟ้าไปสู่โหลด หรือเครื่องใช้ไฟฟ้า', 'Electric Circuit - Introduction, Types, Diagram (vedantu.com)', 245);
INSERT INTO `it_keyword_meaning` VALUES (246, 'supplementary memory system that temporarily stores frequently used instructions and data for quicker processing', 'ส่วนของข้อมูลที่ถูกเก็บซ้ำไว้ในคอมพิวเตอร์ เพื่อใช้ในการใช้งานครั้งต่อไปโดยไม่ต้องเรียกข้อมูลจากต้นแหล่งอีกครั้ง', NULL, 246);
INSERT INTO `it_keyword_meaning` VALUES (247, 'software that allows a user to run other applications on a computing device.', 'เป็นขั้นตอนการเขียน ทดสอบ และดูแลซอร์สโค้ดของโปรแกรมคอมพิวเตอร์', 'What is an Operating System (OS)? - Definition from Techopedia', 247);
INSERT INTO `it_keyword_meaning` VALUES (248, 'a flowchart-like representation of data that graphically resembles a tree that has been drawn upside down.', ' เป็นโมเดลทางคณิตศาสตร์ที่ใช้ทำนายประเภทของวัตถุโดยพิจารณาจากลักษณะของวัตถุ บัพภายใน (inner node) ของต้นไม้จะแสดงตัวแปร ส่วนกิ่งจะแสดงค่าที่เป็นไปได้ของตัวแปร ส่วนบัพใบ (leaf node) จะแสดงประเภทของวัตถุ', 'What is a Decision Tree? - Definition from Techopedia', 248);
INSERT INTO `it_keyword_meaning` VALUES (249, 'the probability of an event, based on prior knowledge of conditions that might be related to the event.', 'ป็นทฤษฎีที่เป็นส่วนขยายของความน่าจะเป็นแบบมีเงื่อนไข หรืออาจกล่าวว่าเป็นการหาความน่าจะเป็นของส่วนย่อยจากเหตุการณ์ที่สนใจหนึ่งที่เกิดขึ้นแล้ว', NULL, 249);
INSERT INTO `it_keyword_meaning` VALUES (250, 'the use of special codes to keep information safe in computer networks', 'การทำให้ข้อมูลที่จะส่งผ่านไปทางเครือข่ายอยู่ในรูปแบบที่ไม่สามารถอ่านออกได้ ด้วยการเข้ารหัส (Encryption) ทำให้ข้อมูลนั้นเป็นความลับ ซึ่งผู้ที่มีสิทธิ์จริงเท่านั้นจะสามารถอ่านข้อมูลนั้นได้ด้วยการถอดรหัส (Decryption)', 'CRYPTOGRAPHY | meaning, definition in Cambridge English Dictionary', 250);
INSERT INTO `it_keyword_meaning` VALUES (251, 'group of computers, each of which acts as a node for sharing files within the group.', 'รูปแบบการเชื่อมต่อแลนไร้สายแบบ Peer to Peer เป็นการเชื่อมต่อแบบโครงข่ายโดยตรง ระหว่างเครื่องคอมพิวเตอร์ โดยเครื่องคอมพิวเตอร์แต่ละเครื่องนั้นจะมีความเท่าเทียมกัน', 'What is a Peer-To-Peer Network (P2P)? - Definition from Techopedia', 251);
INSERT INTO `it_keyword_meaning` VALUES (252, 'a software distribution model that delivers application programs over the Internet. End users can access SaaS cloud apps with a web browser.', 'รูปแบบการให้บริการ ซอฟต์แวhttps://www.mindphp.com/%E0%B8%84%E0%B8%B9%E0%B9%88%E0%B8%A1%E0%B8%B7%E0%B8%AD/73-%E0%B8%84%E0%B8%B7%E0%B8%AD%E0%B8%AD%E0%B8%B0%E0%B9%84%E0%B8%A3/3867-what-is-saas.html#:~:text=SaaS%20%E0%B9%80%E0%B8%AD%E0%B8%AA%E0%B9%80%E0%B8%AD', 'What is Software as a Service (SaaS)? - Definition from Techopedia', 252);
INSERT INTO `it_keyword_meaning` VALUES (253, 'a type of cloud computing service that offers essential compute, storage, and networking resources on demand, on a pay-as-you-go basis', 'บริการคลาวด์คอมพิวเตอร์ หรือเช่าเซิร์ฟเวอร์สำหรับการประมวลผลและการจัดเก็บข้อมูลในระบบคลาวด์', NULL, 253);
INSERT INTO `it_keyword_meaning` VALUES (254, 'a suggestion that something unpleasant or violent will happen, especially if a particular action or order is not followed', 'สิ่งที่อาจก่อให้เกิดความเสียหายแก่คุณสมบัติของข้อมูลหรือสารสนเทศในด้านใดด้านหนึ่งหรือมากกว่าหนึ่งด้าน โดยอาจเกิดจากธรรมชาติหรือบุคคล อาจจะตั้งใจหรือไม่ก็ตามหากพิจารณาตามความเสียหายที่เกิดขึ้น อาจแบ่งประเภทภัยคุกคามออกเป็น 2 ประเภทได้แก่ ภัยคุกคามทางกายภาพ', 'THREAT | meaning, definition in Cambridge English Dictionary', 254);
INSERT INTO `it_keyword_meaning` VALUES (255, 'the activity of using a computer to access information stored on another computer system without permission, or to spread a computer virus', 'การเจาะเข้าโปรแกรมคอมพิวเตอร์อย่างผิดกฎหมายแต่เดิม การเจาะเข้าใช้ระบบโดยไม่ได้รับอนุญาต จะใช้คำว่า Cracking (Cracker) ส่วนคำว่า Hacking (Hacker) จะหมายถึงผู้ที่ใช้คอมพิวเตอร์และ ซอฟต์แวร์อย่างเชี่ยวชาญแต่ในปัจจุบันกลับใช้คำว่า Hacking (Hacker) ในทางลบ', 'HACKING | meaning, definition in Cambridge English Dictionary', 255);
INSERT INTO `it_keyword_meaning` VALUES (256, 'are computer networks that are not connected by cables of any kind.', 'ระบบการสื่อสารข้อมูลที่มีรูปแบบในการสื่อสารแบบไม่ใช้สาย', 'What is Wireless Network? - Definition from Techopedia', 256);
INSERT INTO `it_keyword_meaning` VALUES (257, 'a hierarchical naming system built on a distributed database. ', 'เป็นระบบการตั้งชื่อให้กับ “ทรัพยากรเครือข่าย”', 'What is the Domain Name System (DNS)? - Definition from Techopedia', 257);
INSERT INTO `it_keyword_meaning` VALUES (258, 'a communications standard that enables application programs and computing devices to exchange messages over a network. It is designed to send packets across the internet and ensure the successful delivery of data and messages over networks.', 'ควบคุมการรับส่งข้อมูลระหว่างแม่ข่ายถึงเครือข่าย เพื่อใช้แลกเปลี่ยนข้อมูลระหว่างกัน โดยตัวโพรโทคอลจะรับประกันความถูกต้อง และลำดับของข้อมูลที่ส่งผ่านระบบเครือข่าย นอกจากนั้นทีซีพียังช่วยจำแนกข้อมูลให้ส่งผ่านไปยังแอปพลิเคชัน ที่ทำงานอยู่บนแม่ข่ายเดียวกันให้ถ', NULL, 258);
INSERT INTO `it_keyword_meaning` VALUES (259, 'the activity of using a computer to access information stored on another computer system without permission, or to spread a computer virus', 'การแทรกซึมเข้าไปในเครื่องคอมพิวเตอร์หรือบัญชีทางคอมพิวเตอร์หรือระบบอิเล็กทรอนิคส์โดยไม่ได้รับอนุญาต', 'HACKING | meaning, definition in Cambridge English Dictionary', 259);
INSERT INTO `it_keyword_meaning` VALUES (260, 'modules that authenticate the user with a specific challenge or authentication technology', 'ขั้นตอนการยืนยันความถูกต้องของหลักฐานที่แสดงว่าเป็นตัวตนเราจริงๆ เช่น ข้อมูลบัตรประชาชน หากใช่ตัวตนเราจริงๆ ก็อาจจะมีระบบที่สอบถามหมายเลขหลังบัตร ซึ่งในส่วนนี้น้อยคนนักที่จะจดจำ', 'Authentication - IBM Documentation', 260);
INSERT INTO `it_keyword_meaning` VALUES (261, 'the interconnected pattern of network elements. A network topology may be physical, mapping hardware configuration, or logical, mapping the path that the data must take in order to travel around the network.', 'เป็นสาขาหลักทางคณิตศาสตร์ที่สนใจเกี่ยวกับคุณสมบัติทางรูปร่างของวัตถุต่าง ๆ ที่ไม่แปรเปลี่ยนภายใต้การดึง ยืด หด บีบ (โดยไม่มีการฉีก การเจาะ หรือ การเชื่อมติดใหม่)', 'What is Topology? - Definition from Techopedia', 261);
INSERT INTO `it_keyword_meaning` VALUES (262, 'a communications standard that enables application programs and computing devices to exchange messages over a network. It is designed to send packets across the internet and ensure the successful delivery of data and messages over networks.', 'ควบคุมการรับส่งข้อมูลระหว่างแม่ข่ายถึงเครือข่าย เพื่อใช้แลกเปลี่ยนข้อมูลระหว่างกัน โดยตัวโพรโทคอลจะรับประกันความถูกต้อง และลำดับของข้อมูลที่ส่งผ่านระบบเครือข่าย นอกจากนั้นทีซีพียังช่วยจำแนกข้อมูลให้ส่งผ่านไปยังแอปพลิเคชัน ที่ทำงานอยู่บนแม่ข่ายเดียวกันให้ถ', NULL, 262);
INSERT INTO `it_keyword_meaning` VALUES (263, 'defined as either a crime involving computing against a digital target or a crime in which a computing system is used to commit criminal offenses.', 'ความปลอดภัยทางไซเบอร์เป็นคำที่ใช้ทั่วไป เพื่ออธิบายชุดของการปฏิบัติ มาตรการ และ / หรือ การกระทำที่ปกป้องเทคโนโลยีและข้อมูลจากการโจมตี ซึ่งกำลังเป็นหัวข้อที่มาแรงในปัจจุบัน', 'What is Cybercrime? - Definition from Techopedia', 263);
INSERT INTO `it_keyword_meaning` VALUES (264, 'the part of a piece of equipment, especially electrical equipment, into which another part fits', 'Socket จะมีลักษณะเป็นช่องเสียบแบบเข็ม (Pin) มีขายึดเพื่อให้สามารถทำการประกบ CPU ลงไป ถูกติดตั้งอยู่บน mainboard เหมือนการเอาของเล่น 2 ชิ้นมารวมร่างกัน ช่วยให้ CPU สามารถสื่อสารกับอุปกรณ์ส่วนอื่นได้ โดยในปัจจุบันก็มีให้เลือกใช้งานกันหลาย Socket ซึ่งจะอ้างอ', 'SOCKET | meaning, definition in Cambridge English Dictionary', 264);
INSERT INTO `it_keyword_meaning` VALUES (265, 'protection of a person, building, organization, or country against threats such as crime or attacks by foreign countries', 'เป็นระดับการต่อต้านหรือป้องกันจากภัย ใช้ได้กับสิ่งที่เป็นคุณเสี่ยงต่อภัยและมีคุณค่าใด ๆ เช่น บุคคล ผู้อยู่อาศัย ชุมชน ชาติหรือองค์การ', 'SECURITY | meaning, definition in Cambridge English Dictionary', 265);
INSERT INTO `it_keyword_meaning` VALUES (266, '(the study and knowledge of) the practical, especially industrial, use of scientific discoveries', 'เป็นการผสมผสานเทคนิก, ทักษะ, วิธีการ และ กระบวนการ เพื่อผลิตสินค้า หรือ บริการ หรือเพื่อบรรวัตถุประสงค์หนึ่ง ๆ', 'TECHNOLOGY | meaning, definition in Cambridge English Dictionary', 266);
INSERT INTO `it_keyword_meaning` VALUES (267, 'to show the meaning or truth of something more clearly, especially by giving examples', 'นําความรู้ในวิทยาการต่าง ๆ มาปรับใช้ให้เป็นประโยชน์. ว. ที่นําความรู้มาปรับใช้ให้เป็นประโยชน์', 'ILLUSTRATE | meaning, definition in Cambridge English Dictionary', 267);
INSERT INTO `it_keyword_meaning` VALUES (268, 'an equation (= a mathematical statement) that expresses a relationship between a function (= a changing mathematical value) and one or more of its derivatives (= measures of the rate at which a function is changing)', 'สมการที่มีอนุพันธ์ต่างๆของฟังก์ชันที่ไม่ทราบค่า (unknown function) หนึ่งฟังก์ชันหรือมากกว่าหนึ่งฟังก์ชันปรากฏอยู่ คำว่า Differential equation (aequatio differentialis)', 'DIFFERENTIAL EQUATION | meaning, definition in Cambridge English Dictionary', 268);
INSERT INTO `it_keyword_meaning` VALUES (269, 'a sum that represents a periodic function as a sum of sine and cosine waves.', 'เป็นอนุกรมที่แต่ละพจน์เป็นผลคูณระหว่างสัมประสิทธิ์และฟังก์ชันตรีโกณมิติ โดยทั่วไปอนุกรมฟูรีเยสามารถใช้เป็นอนุกรมแทนฟังก์ชันคาบได้', NULL, 269);
INSERT INTO `it_keyword_meaning` VALUES (270, 'a device that is used to record that something is present or that there are changes in something', 'อุปกรณ์ตรวจจับสัญญาณหรืองปริมาณทางฟิสิกส์ต่างๆ เช่น อุณหภูมิ เสียง แสง การสัมผัส', 'SENSOR | meaning, definition in Cambridge English Dictionary', 270);
INSERT INTO `it_keyword_meaning` VALUES (271, 'a chip-level computer that integrates peripheral interfaces such as memory, Timer, USB, A/D conversion, UART, PLC, DMA, etc., and even LCD driver circuits onto a single chip.', 'อุปกรณ์ควบคุมขนาดเล็ก ซึ่งบรรจุความสามารถที่คล้ายคลึงกับระบบคอมพิวเตอร์', 'Microcontroller Unit (MCU) (pcbgogo.com)', 271);
INSERT INTO `it_keyword_meaning` VALUES (272, 'an integrated circuit designed to be configured by a customer or a designer after manufacturing', 'วงจรรวมที่ออกแบบให้กำหนดค่าโดยลูกค้าหรือผู้ออกแบบหลังการผลิต', NULL, 272);
INSERT INTO `it_keyword_meaning` VALUES (273, 'the process of gradually learning something or gaining something such as a skill', 'การได้ข้อมูลจากแหล่งข้อมูล ทุติยภูมิที่มีผู้อื่นได้เก็บบันทึก หรือรายงานแล้วมาใช้ในการ วิเคราะห์ต่อไป', 'ACQUISITION | meaning, definition in Cambridge English Dictionary', 273);
INSERT INTO `it_keyword_meaning` VALUES (274, 'the engineering and operation of machines that can autonomously or semi-autonomously perform physical tasks on behalf of a human.', 'เครื่องยนต์ชนิดหนึ่งที่มีลักษณะโครงสร้างและรูปร่างแตกต่างกันไปตามวัตถุประสงค์ หุ่นยนต์ในแต่ละประเภทจะมีหน้าที่การทำงานในด้านต่าง ๆ ตามการควบคุมโดยตรงของมนุษย์', 'What is Robotics? - Definition from Techopedia', 274);
INSERT INTO `it_keyword_meaning` VALUES (275, 'the state of having many parts and being difficult to understand or find an answer to', 'ความซับซ้อนของขั้นตอนวิธี', 'COMPLEXITY | meaning, definition in Cambridge English Dictionary', 275);
INSERT INTO `it_keyword_meaning` VALUES (276, ' an application programming interface (API) that supports multi-platform shared-memory multiprocessing programming in C, C++, and Fortran, on many platforms', 'คือ API ที่ช่วยการเขียนโปรแกรมเชิงขนานเป็นเรื่องง่ายมากขึ้น, ขณะนี้รองรับภาษา C/C++, Fortran และทำงานได้ในหลาย platform', NULL, 276);
INSERT INTO `it_keyword_meaning` VALUES (277, 'the use of a GPU (graphics processing unit) as a co-processor to accelerate CPUs for general-purpose scientific and engineering computing.', 'หน่วยประมวลผลพิเศษที่รับภาระการให้แสงและเงาคอมพิวเตอร์กราฟิกส์สามมิติแทนหน่วยประมวลผลกลาง', NULL, 277);
INSERT INTO `it_keyword_meaning` VALUES (278, 'the integrations of computation, communication, and control that achieve the desired performance of physical processes.', 'ระบบทางวิศวกรรมที่บูรณาการโลกกายภาพ', 'Cyber-Physical Systems - an overview | ScienceDirect Topics', 278);
INSERT INTO `it_keyword_meaning` VALUES (279, 'an early sample, model, or release of a product built to test a concept or process.', 'การแปลงไอเดียให้เป็นรูปเป็นร่างอย่างง่ายสุด ถูกสุด เร็วสุด', NULL, 279);
INSERT INTO `it_keyword_meaning` VALUES (280, 'a dedicated computer system designed for one or two specific functions.', 'ระบบประมวลผล ที่ใช้ชิปหรือไมโครโพรเซสเซอร์ที่ออกแบบมาโดยเฉพาะ', 'What is an Embedded System? - Definition from Techopedia', 280);
INSERT INTO `it_keyword_meaning` VALUES (281, 'a subfield of physics, developed in classical mechanics, that describes the motion of points, bodies (objects), and systems of bodies (groups of objects) without considering the forces that cause them to move.', 'เป็นสาขาหนึ่งของวิทยาศาสตร์ที่ว่าด้วยพฤติกรรมของวัตถุทางกายภาพเมื่อถูกแรงกระทำหรือเมื่องมีการกระจัด', 'Kinematics - Wikipedia', 281);
INSERT INTO `it_keyword_meaning` VALUES (282, 'a particular way in which something is done, is organized, or happens', 'ข้อมูลที่มาจากการเคลื่อนไหวของราคาที่เป็นข้อมูลชุด', 'PATTERN | meaning, definition in Cambridge English Dictionary', 282);
INSERT INTO `it_keyword_meaning` VALUES (283, 'the scientific study of the body and how its parts are arranged', 'เป็นสาขาหนึ่งของวิทยาศาสตร์การแพทย์ ที่เน้นทางด้านการศึกษาโครงสร้างต่างๆที่ประกอบกันเป็นร่างกายของมนุษย์ ', 'ANATOMY | meaning, definition in Cambridge English Dictionary', 283);
INSERT INTO `it_keyword_meaning` VALUES (284, 'the process of using a set of resources to solve a problem in less time by dividing the work.', 'เป็นกระบวนทัศน์ของคอมพิวเตอร์ที่ช่วยในการประมวลผลปัญหาที่มีขนาดใหญ่และซับซ้อนได้เร็วขึ้น เป็นแนวคิดที่ใช้โดยทั่วไปในระบบขนาดใหญ่ที่ปรับขนาดได้ซึ่งแม้แต่ \"for-loop\" แบบธรรมดาก็ต้องใช้เวลาในการดำเนินการ', 'parallel programming - ค้นหา (bing.com)', 284);
INSERT INTO `it_keyword_meaning` VALUES (285, 'objects that represent the real-world components in mechanical, electrical, and plumbing systems.', 'สิ่งมีชีวิตดูเหมือนว่าจะได้รับการออกแบบโดยสิ่งมีชีวิตทรงปัญญา มากกว่าที่จะเกิดขึ้นด้วยกับกระบวนทางธรรมชาติแบบสุ่มโดยไร้ทิศทาง ', 'About Intelligent Objects | AutoCAD MEP 2022 | Autodesk Knowledge Network', 285);
INSERT INTO `it_keyword_meaning` VALUES (286, 'a thing that you can see or touch but that is not usually a living animal, plant, or person', ' วัตถุดิบ  วัตถุนิยม  วัตถุประสงค์  วัตถุมงคล  วัตถุวิสัย ', 'OBJECT | meaning, definition in Cambridge English Dictionary', 286);
INSERT INTO `it_keyword_meaning` VALUES (287, 'a piece of planned work or an activity that is finished over a period of time and intended to achieve a particular purpose', 'การจัดการเรียนรู้ที่ทำให้ผู้เรียนได้ศึกษาค้นคว้าในเรื่องราวที่ผู้เรียนมีความสนใจ และเกิดปัญหาข้อสงสัยในการค้นคว้าหาคำตอบด้วยวิธีการที่หลากหลาย', 'PROJECT | meaning, definition in Cambridge English Dictionary', 287);
INSERT INTO `it_keyword_meaning` VALUES (288, 'something that you must do, or something you need', 'ความจำเป็น, ข้อบังคับ, การเรียกร้อง', 'REQUIREMENT | meaning, definition in Cambridge English Dictionary', 288);
INSERT INTO `it_keyword_meaning` VALUES (289, 'a standardized modeling language enabling developers to specify, visualize, construct and document artifacts of a software system.', 'เป็นภาษากราฟิกสำหรับ OOAD ที่ให้วิธีมาตรฐานในการเขียนพิมพ์เขียวของระบบซอฟต์แวร์ ช่วยให้เห็นภาพ ระบุ สร้าง และจัดทำเอกสารสิ่งประดิษฐ์ของระบบเชิงวัตถุ ใช้เพื่อพรรณนาโครงสร้างและความสัมพันธ์ในระบบที่ซับซ้อน', 'What is Unified Modeling Language (UML)? - Definition from Techopedia', 289);
INSERT INTO `it_keyword_meaning` VALUES (290, 'the process of checking data for accuracy after a data migration. There are different types of verification', 'การพิสูจน์ความจริง การยืนยันความเป็นจริง, หลักฐานพิสูจน์ความจริง', 'What is Data Verification? - Definition from Techopedia', 290);
INSERT INTO `it_keyword_meaning` VALUES (291, 'the process of verifying whether a product meets required specifications and customer expectations.', 'เป็นวิธีบริหารจัดการเพื่อเป็นหลักประกันหรือสร้างความมั่นใจว่ากระบวนการหรือการดำเนินงานจะทำให้ได้ผลลัพธ์ที่มีคุณภาพตรงตามที่กำหนด', 'What is Quality Assurance (QA)? - Definition from Techopedia', 291);
INSERT INTO `it_keyword_meaning` VALUES (292, 'the process of transferring business process IT resources to a newer hardware infrastructure or a different software platform for the purpose of keeping up with current technologies and/or to gain better business value.', 'การสร้าง versioning ของการทำงานกับฐานข้อมูล', 'What is a System Migration? - Definition from Techopedia', 292);
INSERT INTO `it_keyword_meaning` VALUES (293, 'your opinion of someone or something', 'การหาค่าซึ่งไม่ใช่ค่าที่แท้จริง แต่มีความละเอียดเพียงพอกับการนำไปใช้', 'ESTIMATION | meaning, definition in Cambridge English Dictionary', 293);
INSERT INTO `it_keyword_meaning` VALUES (294, 'an organized collection of structured information, or data, typically stored electronically in a computer system.', 'ระบบที่รวบรวมข้อมูลต่าง ๆ ที่เกี่ยวข้องกันเข้าไว้ด้วยกันอย่างมีระบบมีความสัมพันธ์ระหว่างข้อมูลต่าง ๆ ที่ชัดเจน ', 'What Is a Database | Oracle', 294);
INSERT INTO `it_keyword_meaning` VALUES (295, 'a functionally independent part of any system. It performs some function and may require some input or produce some output. A component in software is often represented by classes.', 'โมดูลที่สร้างขึ้นล่วงหน้าที่ช่วยให้คุณเพิ่มฟังก์ชันการทำงานเฉพาะให้โฆษณาและเอกสาร HTML ของคุณได้ คอมโพเนนต์ที่ใช้ได้จะอยู่ในแผง \"คอมโพเนนต์\"', 'What is Component? - Definition from Techopedia', 295);
INSERT INTO `it_keyword_meaning` VALUES (296, 'an interface through which a user interacts with electronic devices such as computers and smartphones through the use of icons, menus and other visual indicators or representations (graphics).', 'ส่วนติดต่อกับผู้ใช้แบบกราฟฟิก (Graphical User Interface เรียกย่อว่า GUI) ของระบบปฏิบัติการส่วนใหญ่จะช่วยใช้ผู้ใช้งาน ใช้งานคอมพิวเตอร์หรือระบบคอมพิวเตอร์ได้ง่ายกว่าแบบข้อความ ดังนั้นการเขียนโปรแกรมด้วยการสร้างส่วนติดต่อผู้ใช้แบบกราฟิกเพื่อควบคุมการทำงานขอ', 'What is a Graphical User Interface (GUI)? - Definition from Techopedia', 296);
INSERT INTO `it_keyword_meaning` VALUES (297, 'the image of something in a mirror or on any reflective surface', 'วกกลับ, ย้อนกลับ, เช่น แสงสะท้อน เสียงสะท้อน, โดยปริยายหมายความว่า แสดงให้เห็นภาพหรือลักษณะอย่างใดอย่างหนึ่ง', 'REFLECTION | meaning, definition in Cambridge English Dictionary', 297);
INSERT INTO `it_keyword_meaning` VALUES (298, 'a visual form used to tell a producer what to produce, when to produce and how much to produce. The word kanban has a Japanese origin that means “card you can see” or “billboard.”', 'ระบบเพื่อสื่อสารและควบคุมให้เกิดการผลิดสินค้าก็ต่อเมื่อมีสินคำสั่งซื้อเกิดขึ้นเท่านั้น', 'What is Kanban? - Definition from Techopedia', 298);
INSERT INTO `it_keyword_meaning` VALUES (299, 'something that is a part of your history or that remains from an earlier time', 'ไม่ทันหรือไม่เป็นไปตามสมัยที่กำลังนิยมกัน เช่น เขาเป็นคนล้าสมัย.', 'LEGACY | meaning, definition in Cambridge English Dictionary', 299);
INSERT INTO `it_keyword_meaning` VALUES (300, 'a reverse engineering and cloning technique that captures copyrighted and patented processes for reconstruction.', 'กระบวนการพัฒนาซอฟต์แวร์ตั้งใจที่จะผลิตซอฟแวร์ที่มีระดับการรับรองของความน่าเชื่อถือ', 'What is Clean Room Design? - Definition from Techopedia', 300);
INSERT INTO `it_keyword_meaning` VALUES (301, 'allows professionals to engage in a number of areas such as analyzing and designing anything from simple microprocessors to highly featured circuits, software design, and operating system development.', 'เป็นศาสตร์ที่เกี่ยวข้องกับการออกแบบและสร้างเครื่องหรือระบบคอมพิวเตอร์ และ ระบบที่ใช้คอมพิวเตอร์ ศาสตร์นี้เกี่ยวข้องกับการศึกษาทางด้านฮาร์ดแวร์ ซอฟต์แวร์ การสื่อสาร ', 'allows professionals to engage in a number of areas such as analyzing and designing anything from simple microprocessors to highly featured circuits, software design, and operating system development.', 301);
INSERT INTO `it_keyword_meaning` VALUES (302, '(the study and knowledge of) the practical, especially industrial, use of scientific discoveries', 'เป็นการผสมผสานเทคนิก, ทักษะ, วิธีการ และ กระบวนการ เพื่อผลิตสินค้า หรือ บริการ หรือเพื่อบรรวัตถุประสงค์หนึ่ง ๆ', 'TECHNOLOGY | meaning, definition in Cambridge English Dictionary', 302);
INSERT INTO `it_keyword_meaning` VALUES (303, 'the process in which someone or something grows or changes and becomes more advanced', 'การเปลี่ยนแปลงที่ละเล็กละน้อย โดยผ่านลำดับขั้นตอนต่างๆ ไปสู่ระดับที่สามารถขยายตัวขึ้น เติบโตขึ้น มีการปรับปรุงให้ดีขึ้น และเหมาะสมกว่าเดิมหรืออาจก้าวหน้าไปถึงขั้นที่อุดมสมบูรณ์เป็นที่น่าพอใจ', 'DEVELOPMENT | meaning, definition in Cambridge English Dictionary', 303);
INSERT INTO `it_keyword_meaning` VALUES (304, 'an approach to problem-solving in which the objective is to produce a working solution within a reasonable time frame. Instead of looking for a perfect solution, heuristic strategies look for a quick solution that falls within an acceptable range of accur', ' เป็นกฎที่ง่าย ๆ และมีประสิทธิภาพ ที่เรามักจะใช้ในการประเมิน[a] และการตัดสินใจ เป็นวิธีลัดทางความคิดโดยเพ่งความสนใจไปยังส่วนหนึ่งของปัญหาที่ซับซ้อนแล้วไม่ใส่ใจในส่วนอื่น', 'What is Heuristic? - Definition from Techopedia', 304);
INSERT INTO `it_keyword_meaning` VALUES (305, 'an iterative set of data science steps you take to deliver a project or analysis.', 'ลำดับขั้นตอนของข้อมูลตั้งแต่เริ่มสร้างข้อมูลไปจนถึงการทำลายข้อมูล การบริหารจัดการข้อมูล มีองค์ประกอบในการบริหารจัดการตลอดทั้งวงจรชีวิตของข้อมูล', 'What is a Data Science Life Cycle? – Joon Solutions', 305);
INSERT INTO `it_keyword_meaning` VALUES (306, 'There are two approaches to evaluating hypotheses: comparison of the hypotheses with the established facts and analytic epidemiology, which allows testing hypotheses.', 'ใช้การวิเคราะห์สถิติเป็นแนวทาง นัยสำคัญเชิงสถิติ', 'https://www.bing.com/ck/a?!&&p=1be41876d5c9b64dJmltdHM9MTY2NDc1NTIwMCZpZ3VpZD0xNjcxZThkYi02ZTEwLTYxMjAtMjU4OS1mOTI2NmZiYjYwMGYmaW5zaWQ9NTM3Mw&ptn=3&hsh=3&fclid=1671e8db-6e10-6120-2589-f9266fbb600f&psq=hypotheses+evaluation&u=a1aHR0cHM6Ly9vbmxpbmUuc3RhdC5w', 306);
INSERT INTO `it_keyword_meaning` VALUES (307, 'relating to words', 'เกี่ยวกับคำหรือศัพท์', 'LEXICAL | meaning, definition in Cambridge English Dictionary', 307);
INSERT INTO `it_keyword_meaning` VALUES (308, 'The term computer graphics has been used in a broad sense to describe \"almost everything on computers that is not text or sound\".', 'การใช้คอมพิวเตอร์สร้างภาพโดยการวาดภาพกราฟิกหรือการใช้ซอฟต์แวร์เกี่ยวกับการวาดภาพต่าง ๆ ในคอมพิวเตอร์ รวมไปถึงการตกแต่งแก้ไขหรือการจัดการเกี่ยวกับรูปภาพโดยใช้เครื่องมือคอมพิวเตอร์ ในการจัดการ', 'Computer graphics - Wikipedia', 308);
INSERT INTO `it_keyword_meaning` VALUES (309, 'to look at or consider again an idea, piece of writing, etc. in order to correct or improve it', 'แก้ไขให้เรียบร้อยยิ่งขึ้น.', 'REVISE | meaning, definition in Cambridge English Dictionary', 309);
INSERT INTO `it_keyword_meaning` VALUES (310, 'a moving image is made by creating each frame in an ‘artificial’ manor, resulting in an aesthetic unique from live action.', 'การสร้างอิริยาบถของภาพให้มีการเปลี่ยนแปลงไปตามช่วงเวลา', 'https://www.bing.com/ck/a?!&&p=f814e01b0753324dJmltdHM9MTY2NDc1NTIwMCZpZ3VpZD0xNjcxZThkYi02ZTEwLTYxMjAtMjU4OS1mOTI2NmZiYjYwMGYmaW5zaWQ9NTQyOQ&ptn=3&hsh=3&fclid=1671e8db-6e10-6120-2589-f9266fbb600f&psq=What+is+animation+making&u=a1aHR0cHM6Ly9qdXN0bWFrZWFua', 310);
INSERT INTO `it_keyword_meaning` VALUES (311, 'the activity or job of writing computer programs', 'การเขียนหรือสร้างคำสั่งให้คอมพิวเตอร์ทำงานให้ได้ตามที่ต้องการ ด้วยภาษาที่คอมพิวเตอร์เข้าใจ', 'PROGRAMMING | meaning, definition in Cambridge English Dictionary', 311);
INSERT INTO `it_keyword_meaning` VALUES (312, 'a branch of computer science that focuses on building and managing technology that can learn to autonomously make decisions and carry out actions on behalf of a human being.', 'เป็นสาขาหนึ่งของวิทยาการคอมพิวเตอร์ที่เน้นการสร้างและจัดการเทคโนโลยีที่สามารถเรียนรู้ที่จะตัดสินใจด้วยตนเองและดำเนินการในนามของมนุษย์', NULL, 312);
INSERT INTO `it_keyword_meaning` VALUES (313, 'someone who starts their own business, especially when this involves seeing a new opportunity', 'สถานที่ซึ่งผู้ประกอบการใช้ประกอบกิจการเป็นประจำและหมายความรวมถึงสถานที่ซึ่งใช้เป็นที่ผลิตหรือเก็บสินค้าเป็นประจำด้วย.', 'ENTREPRENEUR | meaning, definition in Cambridge English Dictionary', 313);
INSERT INTO `it_keyword_meaning` VALUES (314, 'the process of analyzing user needs and designing, constructing, and testing end-user applications that will satisfy these needs through the use of software programming languages. It is the application of engineering principles to software development.', 'วิศวกรรมซอฟต์แวร์ประยุกต์ความรู้และเทคโนโลยีทางด้านวิศวกรรมศาสตร์ วิศวกรรมคอมพิวเตอร์ วิทยาการคอมพิวเตอร์ เทคโนโลยีสารสนเทศและสาขาอื่น ๆ ที่เกี่ยวข้องเข้าด้วยกัน เพื่อสร้างซอฟต์แวร์ที่สามารถปฏิบัติงานตามเป้าหมาย ภายใต้เงื่อนไขที่กำหนด', 'What is Software Engineering? - Definition from Techopedia', 314);
INSERT INTO `it_keyword_meaning_minor` VALUES (4, NULL, NULL, NULL, NULL, 22);
INSERT INTO `it_keyword_meaning_minor` VALUES (5, NULL, NULL, NULL, NULL, 24);
